INSERT INTO `xujm_cms_article` VALUES ('1', '1', 'zh_CN', '用户协议', '用户协议', '用户协议', '<div id=\"user_agreement\">\r\n    <h3>三倍王用户协议</h3>\r\n\r\n    <p>本《用户协议》是您(下称\"用户\")与Sands Technology Sdn BHD公司(下称“我方”)之间在使用我方出品的各类产品之前，注册用户(又名“账号”，下统称“账号”)和使用产品时签署的协议。</p>\r\n\r\n    <h4>一、重要须知---在签署本协议之前，我方正式提醒用户：</h4>\r\n    1.1、 您应认真阅读(未成年人应当在监护人陪同下阅读)、充分理解本《用户协议》各条款，特别是免除或者限制我方责任的免责条款，用户的权利限制条款，约定争议解决方式、司法管辖、法律适用的条款。<br>\r\n    1.2、 除非您接受本协议，否则用户无权无必要继续接受我方的服务，可以退出本次注册。用户点击接受并继续使用的服务，视为用户已完全的接受本协议。<br>\r\n    1.3、 本协议在您开始使用我方的服务，并注册成为我方产品的用户时即产生法律效力，请您慎重考虑是否接受本协议，如不接受本协议的任一条款，请自动退出并不再接受我方的任何服务。<br>\r\n    1.4、 在您签署本协议之后，此文本可能因国家政策、产品以及履行本协议的环境发生变化而进行修改，我们会将修改后的协议发布在本网站上，若您对修改后的协议有异议的，请立即停止登录、使用我方产品及服务，若您登录或继续使用我方产品，视为认可修改后的协议。<br>\r\n    <h4>二、关于“帐号”</h4>\r\n    2.1、 我方在旗下业务平台提供用户注册通道，用户在认可并接受本协议之后，有权选择未被其他用户使用过的字母符号组合作为用户的帐号，并自行设置符合安全要求的密码。用户设置的帐号、密码是用户用以登录我方产品，接受我方服务的凭证。<br>\r\n    2.2、 用户在注册了我方帐号并不意味获得全部我方产品的授权，仅仅是取得了接受我方服务的身份，用户在登录相关网页、加载应用、下载安装软件时需要另行签署单个产品的授权协议。<br>\r\n    2.3、 我方账户仅限于在我方网站上注册用户本人使用，禁止赠与、借用、租用、转让或售卖。如果我方发现或者有理由怀疑使用者并非帐号初始注册人，则有权在未经通知的情况下，暂停或终止向用户提供服务，并有权注销该帐号，而无需向该帐号使用人承担法律责任，由此带来的包括并不限于用户通讯中断、用户资料和信息等清空等损失由用户自行承担。<br>\r\n    2.4、 用户有责任维护个人帐号、密码的安全性与保密性，用户就其帐号及密码项下之一切活动负全部责任，包括用户数据的修改，发表的言论以及其他所有的损失。用户应重视我方帐号密码保护。用户如发现他人未经许可使用其帐号或发生其他任何安全漏洞问题时立即通知我方。如果用户在使用我方服务时违反上述规则而产生任何损失或损害，我方不承担任何责任。<br>\r\n    2.5、 用户帐号在丢失或遗忘密码后，可遵照我方的申诉途径及时申诉请求找回帐号。用户应提供能增加帐号安全性的个人密码保护资料。用户可以凭初始注册资料及个人密码保护资料填写申诉单向我方申请找回帐号，我方的密码找回机制仅负责识别申诉单上所填资料与系统记录资料的正确性，而无法识别申诉人是否系真正帐号有权使用人。对用户因被他人冒名申诉而致的任何损失，我方不承担任何责任，用户知晓帐号及密码保管责任在于用户，我方并无义务保证帐号丢失或遗忘密码后用户一定能通过申诉找回帐号。<br>\r\n    2.6、 用户应保证注册我方帐号时填写的身份信息的真实性，任何由于非法、不真实、不准确的用户信息所产生的责任由用户承担。用户应不断根据实际情况更新注册资料，符合及时、详尽、真实、准确的要求。所有原始键入的资料将引用用户的帐号注册资料。如果因用户的注册信息不真实而引起的问题，以及对问题发生所带来的后果，我方不负任何责任。如果用户提供的信息不准确、不真实、不合法或者我方有理由怀疑为错误、不实或不完整的资料或在个人资料中发布广告、不严肃内容及无关信息，我方有权暂停或终止向用户提供服务，注销该帐号，并拒绝用户现在和未来使用我方服务之全部或任何部分。因此产生的一切损失由用户自行承担。<br>\r\n    2.7、 除自行注册我方帐号外，用户也可选择使用已有的微信登录和使用我方的产品。用户可通过我方产品的帐号管理后台授权并登录我方的产品。<br>\r\n    <h4>三、用户在使用我方产品时，应当遵守《中华人民共和国宪法》、《中华人民共和国刑法》、《中华人民共和国民法通则》、《中华人民共和国合同法》、《中华人民共和国著作权法》、《中华人民共和国电信条例》、《互联网信息服务管理办法》、《互联网电子公告服务管理规定》、《计算机信息网络国际互联网安全保护管理办法》等相关规定。用户不得利用我方服务产品从事违反法律法规、政策以及侵犯他人合法权益的行为，包括但不限于下列行为：</h4>\r\n    3.1、 利用我方服务产品发表、传送、传播、储存反对宪法所确定的基本原则的、危害国家安全、国家统一、社会稳定的、煽动民族仇恨、民族歧视、破坏民族团结的内容，或侮辱诽谤、色情、暴力、引起他人不安及任何违反国家法律法规政策的内容或者设置含有上述内容的网名、角色名。<br>\r\n    3.2、 利用我方服务发表、传送、传播、储存侵害他人知识产权、商业机密、肖像权、隐私权等合法权利或其他道德上令人反感的内容。<br>\r\n    3.3、 进行任何危害计算机网络安全的行为，包括但不限于：使用未经许可的数据或进入未经许可的服务器/帐户;未经允许进入公众计算机网络或者他人计算机系统并删除、修改、增加存储信息;未经许可，企图探查、扫描、测试本“软件”系统或网络的弱点或其它实施破坏网络安全的行为;企图干涉、破坏本“软件”系统或网站的正常运行，故意传播恶意程序或病毒以及其他破坏干扰正常网络信息服务的行为;伪造TCP/IP数据包名称或部分名称;自行或利用其他软件对我方提供产品进行反向破解等违法行为。<br>\r\n    3.4、 进行任何诸如发布广告、推广信息、销售商品的行为，或者进行任何非法的侵害我方利益的行为。<br>\r\n    3.5、 进行其他任何违法以及侵犯其他个人、公司、社会团体、组织的合法权益的行为或者法律、行政法规、规章、条例以及任何具有法律效力之规范所限制或禁止的其他行为。在任何情况下，如果我方有理由认为用户的任何行为，包括但不限于用户的任何言论和其它行为违反或可能违反法律法规、国家政策以及本协议的任何规定，我方可在任何时候不经任何事先通知，即有权终止向用户提供服务。<br>\r\n    <h4>四、我方声明</h4>\r\n    4.1、 用户须知，在使用我方服务可能存在有来自任何他人的包括威胁性的、诽谤性的、令人反感的或非法的内容或行为或对他人权利的侵犯(包括知识产权)的匿名或冒名的信息的风险，用户须承担以上风险，我方对服务不作担保，不论是明确的或隐含的，包括所有有关信息真实性、适当性、适于某一特定用途、所有权和非侵权性的默示担保和条件，对因此导致任何因用户不正当或非法使用服务产生的直接、间接、偶然、特殊及后续的损害，我方不承担任何责任。<br>\r\n    4.2、 使用我方服务必须遵守国家有关法律和政策等，维护国家利益，保护国家安全，并遵守本协议，对于用户违法行为或违反本协议的使用(包括但不限于言论发表、传送等)而引起的一切责任，由用户承担全部责任。<br>\r\n    4.3、 我方有权自动收集用户在其他社交平台发表的信息，用户授权三倍王使用其发表的内容用于在我方旗下业务平台产品上进行商业用途。<br>\r\n    4.4、 我方提供的所有信息、资讯、内容和服务均来自互联网，并不代表我方的观点，我方对其真实性、合法性概不负责，亦不承担任何法律责任。<br>\r\n    4.5、 我方所提供的产品和服务也属于互联网范畴，也易受到各种安全问题的困扰，包括但不限于：<br>\r\n\r\n    1)个人资料被不法分子利用，造成现实生活中的骚扰;<br>\r\n    2)哄骗、破译密码;<br>\r\n    3)下载安装的其它软件中含有“特洛伊木马”等病毒程序，威胁到个人计算机上信息和数据的安全，继而威胁对本服务的使用。<br>\r\n    4）以及其他类网络安全困扰问题<br>\r\n    对于发生上述情况的，用户应当自行承担责任。<br>\r\n\r\n    4.6、 用户须明白，我方为了整体运营的需要，有权在公告通知后，在不事先通知用户的情况下修改、中断、中止或终止服务，而无须向用户或第三方负责，我方不承担任何赔偿责任。<br>\r\n    4.7、 用户应理解，互联网技术存在不稳定性，可能导致政府管制、政策限制、病毒入侵、黑客攻击、服务器系统崩溃或者其他现今技术无法解决的风险发生。由以上原因可能导致我方服务中断或帐号信息损失，对此非人为因素引起的用户损失由用户自行承担责任。<br>\r\n    <h4>五、知识产权</h4>\r\n    5.1、 我方对其旗下运营的网页、应用、软件等产品和服务享有知识产权。受中国法律的保护。<br>\r\n    5.2、 用户不得对我方服务涉及的相关网页、应用、软件等产品进行反向工程、反向汇编、反向编译等。<br>\r\n    5.3、 用户只能在本《用户协议》以及相应的授权许可协议授权的范围内使用我方知识产权，未经授权超范围使用的，构成对我方的侵权。<br>\r\n    5.4、 用户在使用我方产品服务时发表上传的文字、图片、视频、软件以及表演等信息，用户的发表、上传行为是对我方服务平台的授权，为非独占性、永久性的授权，该授权可转授权。我方可将前述信息在我方旗下的所有服务平台上使用，可再次编辑后使用，也可以由我方授权给合作方使用。<br>\r\n    5.5、 用户应保证，在使用我方产品服务时上传的文字、图片、视频、软件以及表演等的信息不侵犯任何第三方知识产权，包括但不限于商标权、著作权等。若用户在使用我方产品服务时上传的文字、图片、视频、软件以及表演等的信息中侵犯第三方知识产权，我方有权移除该侵权产品，并对此不负任何责任。用户应当负责处理前述第三方的权利主张，承担由此产生的全部费用，包括但不限于侵权赔偿、律师费及其他合理费用，并保证我方不会因此而遭受任何损失。<br>\r\n    5.6、 任何单位或个人认为通过我方提供服务的内容可能涉嫌侵犯其知识产权或信息网络传播权，应该及时向我方提出书面权利通知投诉，并提供身份证明、权属证明及详细侵权情况证明。我方在收到上述法律文件后，将会依法尽快断开相关链接内容。我方提供投诉通道，triplegain33@gmail.com。如投诉中未向我方提供合法有效的证明材料，我方有权不采取任何措施。<br>\r\n    <h4>六、隐私保护</h4>\r\n    我方非常重视用户的隐私权，用户在享受提供的服务时可能涉及用户的隐私，因此请用户仔细阅读本隐私保护条款。<br>\r\n    6.1、 请用户注意勿在使用我方服务中透露自己的各类财产帐户、银行卡、信用卡、第三方支付账户及对应密码等重要信息资料，否则由此带来的任何损失由用户自行承担。<br>\r\n    6.2、 用户的帐号、密码属于保密信息，我方会努力采取积极的措施保护用户帐号、密码的安全。<br>\r\n    6.3、 互联网的开放性以及技术更新速度快，因非我方可控制的因素导致用户信息泄漏的，我方不承担任何责任。<br>\r\n    6.4、 用户在使用我方服务时不应将自认为隐私的信息发表、上传至我方，也不应将该等信息通过我方的服务传播给其他人，由于用户的行为引起的隐私泄漏，由用户自行承担责任。<br>\r\n</div>', '', '1', '20180806114825');
INSERT INTO `xujm_cms_article` VALUES ('2', '1', 'en_US', 'User protocol', 'User protocol', 'User protocol', '<div id=\"user_agreement\">\r\n    <h3>三倍王用户协议</h3>\r\n\r\n    <p>本《用户协议》是您(下称\"用户\")与Sands Technology Sdn BHD公司(下称“我方”)之间在使用我方出品的各类产品之前，注册用户(又名“账号”，下统称“账号”)和使用产品时签署的协议。</p>\r\n\r\n    <h4>一、重要须知---在签署本协议之前，我方正式提醒用户：</h4>\r\n    1.1、 您应认真阅读(未成年人应当在监护人陪同下阅读)、充分理解本《用户协议》各条款，特别是免除或者限制我方责任的免责条款，用户的权利限制条款，约定争议解决方式、司法管辖、法律适用的条款。<br>\r\n    1.2、 除非您接受本协议，否则用户无权无必要继续接受我方的服务，可以退出本次注册。用户点击接受并继续使用的服务，视为用户已完全的接受本协议。<br>\r\n    1.3、 本协议在您开始使用我方的服务，并注册成为我方产品的用户时即产生法律效力，请您慎重考虑是否接受本协议，如不接受本协议的任一条款，请自动退出并不再接受我方的任何服务。<br>\r\n    1.4、 在您签署本协议之后，此文本可能因国家政策、产品以及履行本协议的环境发生变化而进行修改，我们会将修改后的协议发布在本网站上，若您对修改后的协议有异议的，请立即停止登录、使用我方产品及服务，若您登录或继续使用我方产品，视为认可修改后的协议。<br>\r\n    <h4>二、关于“帐号”</h4>\r\n    2.1、 我方在旗下业务平台提供用户注册通道，用户在认可并接受本协议之后，有权选择未被其他用户使用过的字母符号组合作为用户的帐号，并自行设置符合安全要求的密码。用户设置的帐号、密码是用户用以登录我方产品，接受我方服务的凭证。<br>\r\n    2.2、 用户在注册了我方帐号并不意味获得全部我方产品的授权，仅仅是取得了接受我方服务的身份，用户在登录相关网页、加载应用、下载安装软件时需要另行签署单个产品的授权协议。<br>\r\n    2.3、 我方账户仅限于在我方网站上注册用户本人使用，禁止赠与、借用、租用、转让或售卖。如果我方发现或者有理由怀疑使用者并非帐号初始注册人，则有权在未经通知的情况下，暂停或终止向用户提供服务，并有权注销该帐号，而无需向该帐号使用人承担法律责任，由此带来的包括并不限于用户通讯中断、用户资料和信息等清空等损失由用户自行承担。<br>\r\n    2.4、 用户有责任维护个人帐号、密码的安全性与保密性，用户就其帐号及密码项下之一切活动负全部责任，包括用户数据的修改，发表的言论以及其他所有的损失。用户应重视我方帐号密码保护。用户如发现他人未经许可使用其帐号或发生其他任何安全漏洞问题时立即通知我方。如果用户在使用我方服务时违反上述规则而产生任何损失或损害，我方不承担任何责任。<br>\r\n    2.5、 用户帐号在丢失或遗忘密码后，可遵照我方的申诉途径及时申诉请求找回帐号。用户应提供能增加帐号安全性的个人密码保护资料。用户可以凭初始注册资料及个人密码保护资料填写申诉单向我方申请找回帐号，我方的密码找回机制仅负责识别申诉单上所填资料与系统记录资料的正确性，而无法识别申诉人是否系真正帐号有权使用人。对用户因被他人冒名申诉而致的任何损失，我方不承担任何责任，用户知晓帐号及密码保管责任在于用户，我方并无义务保证帐号丢失或遗忘密码后用户一定能通过申诉找回帐号。<br>\r\n    2.6、 用户应保证注册我方帐号时填写的身份信息的真实性，任何由于非法、不真实、不准确的用户信息所产生的责任由用户承担。用户应不断根据实际情况更新注册资料，符合及时、详尽、真实、准确的要求。所有原始键入的资料将引用用户的帐号注册资料。如果因用户的注册信息不真实而引起的问题，以及对问题发生所带来的后果，我方不负任何责任。如果用户提供的信息不准确、不真实、不合法或者我方有理由怀疑为错误、不实或不完整的资料或在个人资料中发布广告、不严肃内容及无关信息，我方有权暂停或终止向用户提供服务，注销该帐号，并拒绝用户现在和未来使用我方服务之全部或任何部分。因此产生的一切损失由用户自行承担。<br>\r\n    2.7、 除自行注册我方帐号外，用户也可选择使用已有的微信登录和使用我方的产品。用户可通过我方产品的帐号管理后台授权并登录我方的产品。<br>\r\n    <h4>三、用户在使用我方产品时，应当遵守《中华人民共和国宪法》、《中华人民共和国刑法》、《中华人民共和国民法通则》、《中华人民共和国合同法》、《中华人民共和国著作权法》、《中华人民共和国电信条例》、《互联网信息服务管理办法》、《互联网电子公告服务管理规定》、《计算机信息网络国际互联网安全保护管理办法》等相关规定。用户不得利用我方服务产品从事违反法律法规、政策以及侵犯他人合法权益的行为，包括但不限于下列行为：</h4>\r\n    3.1、 利用我方服务产品发表、传送、传播、储存反对宪法所确定的基本原则的、危害国家安全、国家统一、社会稳定的、煽动民族仇恨、民族歧视、破坏民族团结的内容，或侮辱诽谤、色情、暴力、引起他人不安及任何违反国家法律法规政策的内容或者设置含有上述内容的网名、角色名。<br>\r\n    3.2、 利用我方服务发表、传送、传播、储存侵害他人知识产权、商业机密、肖像权、隐私权等合法权利或其他道德上令人反感的内容。<br>\r\n    3.3、 进行任何危害计算机网络安全的行为，包括但不限于：使用未经许可的数据或进入未经许可的服务器/帐户;未经允许进入公众计算机网络或者他人计算机系统并删除、修改、增加存储信息;未经许可，企图探查、扫描、测试本“软件”系统或网络的弱点或其它实施破坏网络安全的行为;企图干涉、破坏本“软件”系统或网站的正常运行，故意传播恶意程序或病毒以及其他破坏干扰正常网络信息服务的行为;伪造TCP/IP数据包名称或部分名称;自行或利用其他软件对我方提供产品进行反向破解等违法行为。<br>\r\n    3.4、 进行任何诸如发布广告、推广信息、销售商品的行为，或者进行任何非法的侵害我方利益的行为。<br>\r\n    3.5、 进行其他任何违法以及侵犯其他个人、公司、社会团体、组织的合法权益的行为或者法律、行政法规、规章、条例以及任何具有法律效力之规范所限制或禁止的其他行为。在任何情况下，如果我方有理由认为用户的任何行为，包括但不限于用户的任何言论和其它行为违反或可能违反法律法规、国家政策以及本协议的任何规定，我方可在任何时候不经任何事先通知，即有权终止向用户提供服务。<br>\r\n    <h4>四、我方声明</h4>\r\n    4.1、 用户须知，在使用我方服务可能存在有来自任何他人的包括威胁性的、诽谤性的、令人反感的或非法的内容或行为或对他人权利的侵犯(包括知识产权)的匿名或冒名的信息的风险，用户须承担以上风险，我方对服务不作担保，不论是明确的或隐含的，包括所有有关信息真实性、适当性、适于某一特定用途、所有权和非侵权性的默示担保和条件，对因此导致任何因用户不正当或非法使用服务产生的直接、间接、偶然、特殊及后续的损害，我方不承担任何责任。<br>\r\n    4.2、 使用我方服务必须遵守国家有关法律和政策等，维护国家利益，保护国家安全，并遵守本协议，对于用户违法行为或违反本协议的使用(包括但不限于言论发表、传送等)而引起的一切责任，由用户承担全部责任。<br>\r\n    4.3、 我方有权自动收集用户在其他社交平台发表的信息，用户授权三倍王使用其发表的内容用于在我方旗下业务平台产品上进行商业用途。<br>\r\n    4.4、 我方提供的所有信息、资讯、内容和服务均来自互联网，并不代表我方的观点，我方对其真实性、合法性概不负责，亦不承担任何法律责任。<br>\r\n    4.5、 我方所提供的产品和服务也属于互联网范畴，也易受到各种安全问题的困扰，包括但不限于：<br>\r\n\r\n    1)个人资料被不法分子利用，造成现实生活中的骚扰;<br>\r\n    2)哄骗、破译密码;<br>\r\n    3)下载安装的其它软件中含有“特洛伊木马”等病毒程序，威胁到个人计算机上信息和数据的安全，继而威胁对本服务的使用。<br>\r\n    4）以及其他类网络安全困扰问题<br>\r\n    对于发生上述情况的，用户应当自行承担责任。<br>\r\n\r\n    4.6、 用户须明白，我方为了整体运营的需要，有权在公告通知后，在不事先通知用户的情况下修改、中断、中止或终止服务，而无须向用户或第三方负责，我方不承担任何赔偿责任。<br>\r\n    4.7、 用户应理解，互联网技术存在不稳定性，可能导致政府管制、政策限制、病毒入侵、黑客攻击、服务器系统崩溃或者其他现今技术无法解决的风险发生。由以上原因可能导致我方服务中断或帐号信息损失，对此非人为因素引起的用户损失由用户自行承担责任。<br>\r\n    <h4>五、知识产权</h4>\r\n    5.1、 我方对其旗下运营的网页、应用、软件等产品和服务享有知识产权。受中国法律的保护。<br>\r\n    5.2、 用户不得对我方服务涉及的相关网页、应用、软件等产品进行反向工程、反向汇编、反向编译等。<br>\r\n    5.3、 用户只能在本《用户协议》以及相应的授权许可协议授权的范围内使用我方知识产权，未经授权超范围使用的，构成对我方的侵权。<br>\r\n    5.4、 用户在使用我方产品服务时发表上传的文字、图片、视频、软件以及表演等信息，用户的发表、上传行为是对我方服务平台的授权，为非独占性、永久性的授权，该授权可转授权。我方可将前述信息在我方旗下的所有服务平台上使用，可再次编辑后使用，也可以由我方授权给合作方使用。<br>\r\n    5.5、 用户应保证，在使用我方产品服务时上传的文字、图片、视频、软件以及表演等的信息不侵犯任何第三方知识产权，包括但不限于商标权、著作权等。若用户在使用我方产品服务时上传的文字、图片、视频、软件以及表演等的信息中侵犯第三方知识产权，我方有权移除该侵权产品，并对此不负任何责任。用户应当负责处理前述第三方的权利主张，承担由此产生的全部费用，包括但不限于侵权赔偿、律师费及其他合理费用，并保证我方不会因此而遭受任何损失。<br>\r\n    5.6、 任何单位或个人认为通过我方提供服务的内容可能涉嫌侵犯其知识产权或信息网络传播权，应该及时向我方提出书面权利通知投诉，并提供身份证明、权属证明及详细侵权情况证明。我方在收到上述法律文件后，将会依法尽快断开相关链接内容。我方提供投诉通道，triplegain33@gmail.com。如投诉中未向我方提供合法有效的证明材料，我方有权不采取任何措施。<br>\r\n    <h4>六、隐私保护</h4>\r\n    我方非常重视用户的隐私权，用户在享受提供的服务时可能涉及用户的隐私，因此请用户仔细阅读本隐私保护条款。<br>\r\n    6.1、 请用户注意勿在使用我方服务中透露自己的各类财产帐户、银行卡、信用卡、第三方支付账户及对应密码等重要信息资料，否则由此带来的任何损失由用户自行承担。<br>\r\n    6.2、 用户的帐号、密码属于保密信息，我方会努力采取积极的措施保护用户帐号、密码的安全。<br>\r\n    6.3、 互联网的开放性以及技术更新速度快，因非我方可控制的因素导致用户信息泄漏的，我方不承担任何责任。<br>\r\n    6.4、 用户在使用我方服务时不应将自认为隐私的信息发表、上传至我方，也不应将该等信息通过我方的服务传播给其他人，由于用户的行为引起的隐私泄漏，由用户自行承担责任。<br>\r\n</div>', '', '1', '20180806114825');
INSERT INTO `xujm_cms_article` VALUES ('3', '2', 'zh_CN', '今年以来，A股市场行情低迷', '今年以来，A股市场行情低迷', '今年以来，A股市场行情低迷', ' <p>今年以来，A股市场行情低迷，上证综指从年初的3314点下跌至8月3日的2740点，跌幅17%。</p>\r\n            <p>中小创同样下跌严重，创业板指于8月3日创出1481点的调整新低，而去年最具赚钱效应的白马股也遭遇剧烈调整。</p>\r\n            <p>与此同时，政策面、消息面的各种变化也接踵而至，货币政策及财政政策出现调整、中美贸易摩擦动态不断、疫苗案扰动医药股的起伏波动……种种因素都在让市场急剧变化。</p>\r\n\r\n            <br>\r\n\r\n            <p>什么才是影响市场调整的核心因素？在这样的调整市中，如何进行后市资产配置？面对诸多不确定性，哪些行业将受到较大影响，哪些产业能穿越熊市？ 现阶段市场已处于底部区域。</p>\r\n            <p>从估值和宏观政策方面来说都已到达比较低的位置，现在的估值离历史上最低的水平也相差不远。</p>\r\n            <p>现在市场正处于不断透支未来利空的阶段。</p>\r\n\r\n            <br>\r\n\r\n            <p>如果把一段熊市分为三阶段，第一阶段是反映过去利空，第二阶段是当下利空，第三阶段是未来利空，现在很多股票处于熊市第三阶段。</p>\r\n            <p>而且，在大盘真正见底之前应该有1000只股票已经见底了，而现在至少有100只股票已经见底了。就像陆续过河一样，等到有1000只左右股票过河，我相信大盘就真正见底了。</p>\r\n\r\n            <br>\r\n\r\n            <p>今年以来，A股市场行情低迷，上证综指从年初的3314点下跌至8月3日的2740点，跌幅17%。</p>\r\n            <p>中小创同样下跌严重，创业板指于8月3日创出1481点的调整新低，而去年最具赚钱效应的白马股也遭遇剧烈调整。</p>\r\n            <p>与此同时，政策面、消息面的各种变化也接踵而至，货币政策及财政政策出现调整、中美贸易摩擦动态不断、疫苗案扰动医药股的起伏波动……种种因素都在让市场急剧变化。</p>\r\n\r\n            <br>\r\n\r\n            <p>什么才是影响市场调整的核心因素？在这样的调整市中，如何进行后市资产配置？面对诸多不确定性，哪些行业将受到较大影响，哪些产业能穿越熊市？ 现阶段市场已处于底部区域。</p>\r\n            <p>从估值和宏观政策方面来说都已到达比较低的位置，现在的估值离历史上最低的水平也相差不远。</p>\r\n            <p>现在市场正处于不断透支未来利空的阶段。</p>\r\n\r\n            <br>\r\n\r\n            <p>如果把一段熊市分为三阶段，第一阶段是反映过去利空，第二阶段是当下利空，第三阶段是未来利空，现在很多股票处于熊市第三阶段。</p>\r\n            <p>而且，在大盘真正见底之前应该有1000只股票已经见底了，而现在至少有100只股票已经见底了。就像陆续过河一样，等到有1000只左右股票过河，我相信大盘就真正见底了。</p>', '', '1', '20180806114825');
