INSERT INTO `xujm_cms_article` VALUES ('6', '5', 'zh_CN', '重磅！国务院决定对美600亿美元商品加征GS', '重磅！国务院决定对美600亿美元商品加征GS', '重磅！国务院决定对美600亿美元商品加征GS', ' <p>8月3日晚间，经国务院批准，国务院GS税则委员会决定对原产于美国5207个税目约600亿美元商品，加征25%、20%、10%、5%不等的GS；如果美方一意孤行，将其加征GS措施付诸实施，中方将即行实施上述加征GS措施。</p>\r\n\r\n            <br>\r\n\r\n        　　<p>中国这次主动还击，出乎很多人意料，但以攻为守，算得上一招秒棋。</p>\r\n            <p>特朗普2000亿砸下来，我们不会措手不及！此外，也是一种警告，我们也会玩真的，别逼急了。</p>\r\n\r\n            <br>\r\n\r\n        　　<p>谈判本身就是心理战，如果我们一味示弱，就会失去谈判的筹码！这次不管川普是想敲诈，还是遏制中国走向大国之路；我们已经下定决心，宁可站着死，不愿跪着生，这是我们的坚定态度。</p>\r\n\r\n            <br>\r\n\r\n        　　<p>中美的毛衣战，不是我们希望的，但躲不过，只能迎战；虽然短期有阵痛，有可能有巨大损失，但从长远看，也许我们会庆幸，当初强力反击是多么重要；作为股民，虽然对毛衣战战战兢兢，但必须从大义出发，正面对待摩擦，不就亏点钱嘛，反正破罐子都摔了几百回了！</p>\r\n\r\n            <br>\r\n\r\n        　　<p>当然，咱们放出600亿这种大招，美股周五还全线飘红，A股却连创新低，编剧都不敢这样编，真是没有对比就不会揪心。</p>\r\n\r\n            <br>\r\n\r\n            <p>8月3日晚间，经国务院批准，国务院GS税则委员会决定对原产于美国5207个税目约600亿美元商品，加征25%、20%、10%、5%不等的GS；如果美方一意孤行，将其加征GS措施付诸实施，中方将即行实施上述加征GS措施。</p>\r\n\r\n            <br>\r\n\r\n        　　<p>中国这次主动还击，出乎很多人意料，但以攻为守，算得上一招秒棋。</p>\r\n            <p>特朗普2000亿砸下来，我们不会措手不及！此外，也是一种警告，我们也会玩真的，别逼急了。</p>\r\n\r\n            <br>\r\n\r\n        　　<p>谈判本身就是心理战，如果我们一味示弱，就会失去谈判的筹码！这次不管川普是想敲诈，还是遏制中国走向大国之路；我们已经下定决心，宁可站着死，不愿跪着生，这是我们的坚定态度。</p>\r\n\r\n            <br>\r\n\r\n        　　<p>中美的毛衣战，不是我们希望的，但躲不过，只能迎战；虽然短期有阵痛，有可能有巨大损失，但从长远看，也许我们会庆幸，当初强力反击是多么重要；作为股民，虽然对毛衣战战战兢兢，但必须从大义出发，正面对待摩擦，不就亏点钱嘛，反正破罐子都摔了几百回了！</p>\r\n\r\n            <br>\r\n\r\n        　　<p>当然，咱们放出600亿这种大招，美股周五还全线飘红，A股却连创新低，编剧都不敢这样编，真是没有对比就不会揪心。</p>\r\n\r\n            <br>\r\n\r\n        　　<p>中国这次主动还击，出乎很多人意料，但以攻为守，算得上一招秒棋。</p>\r\n            <p>特朗普2000亿砸下来，我们不会措手不及！此外，也是一种警告，我们也会玩真的，别逼急了。</p>\r\n\r\n            <br>\r\n\r\n        　　<p>谈判本身就是心理战，如果我们一味示弱，就会失去谈判的筹码！这次不管川普是想敲诈，还是遏制中国走向大国之路；我们已经下定决心，宁可站着死，不愿跪着生，这是我们的坚定态度。</p>\r\n\r\n            <br>\r\n\r\n        　　<p>中美的毛衣战，不是我们希望的，但躲不过，只能迎战；虽然短期有阵痛，有可能有巨大损失，但从长远看，也许我们会庆幸，当初强力反击是多么重要；作为股民，虽然对毛衣战战战兢兢，但必须从大义出发，正面对待摩擦，不就亏点钱嘛，反正破罐子都摔了几百回了！</p>\r\n\r\n            <br>\r\n\r\