INSERT INTO `xujm_cms_article` VALUES ('9', '8', 'zh_CN', '重磅！阿里苏宁69亿元入股华泰证券', '证监会核发2家企业IPO批文筹资总额不超17亿', '重磅！阿里苏宁69亿元入股华泰证券', '<p>华泰证券发布定增公告，发行对象包括阿里巴巴、苏宁易购、安信证券等，其中，阿里出资约35亿元，苏宁易购出资约34亿元。发行完成后，阿里巴巴将成为华泰证券第6大股东，持股比例达3.25%；苏宁易购为第7大股东，持股比例约为3.16%。</p>\r\n            <br>\r\n            <p>去年腾讯入股中金，现在马云也杀进来了，阿里腾讯的战火，已经打到证券行业，两家都在笼络龙头券商，这次谁胜谁负？</p>\r\n            <br>\r\n            <p>此前，京东被爆收购第一创业24%股份，虽然被辟谣，但足以证明，互联网巨头对券商是真爱！随着巨头持续加入，券商股或迎破局之际。</p>\r\n            <br>\r\n            <p>不过，阿里苏宁这次增发价只有13块，比周五收盘价还低10%，卖的没有买的精，马爸爸果然会玩，一方面跟腾讯竞争，一方面抄了底，进可攻退可守。</p>\r\n            <br>\r\n            <p>券商股已经跌了3年，估值确实很低，但券商这种周期性行业，牛市才能暴动，但现在A股却是股灾，情何以堪！</p>\r\n            <br>\r\n            <p>必须要说，阿里炒A股水平很烂，买一个套一个，实在不敢恭维；倒是苏宁是“股神”，现在股神和菜鸟一起看上华泰，结局会如何呢？至少下周券商要暴动了。</p>\r\n            <br>\r\n            <p>去年腾讯入股中金，现在马云也杀进来了，阿里腾讯的战火，已经打到证券行业，两家都在笼络龙头券商，这次谁胜谁负？</p>\r\n            <br>\r\n            <p>此前，京东被爆收购第一创业24%股份，虽然被辟谣，但足以证明，互联网巨头对券商是真爱！随着巨头持续加入，券商股或迎破局之际。</p>\r\n            <br>\r\n            <p>不过，阿里苏宁这次增发价只有13块，比周五收盘价还低10%，卖的没有买的精，马爸爸果然会玩，一方面跟腾讯竞争，一方面抄了底，进可攻退可守。</p>\r\n            <br>\r\n            <p>券商股已经跌了3年，估值确实很低，但券商这种周期性行业，牛市才能暴动，但现在A股却是股灾，情何以堪！</p>\r\n            <br>\r\n            <p>必须要说，阿里炒A股水平很烂，买一个套一个，实在不敢恭维；倒是苏宁是“股神”，现在股神和菜鸟一起看上华泰，结局会如何呢？至少下周券商要暴动了。</p>\r\n            <br>\r\n            <p>去年腾讯入股中金，现在马云也杀进来了，阿里腾讯的战火，已经打到证券行业，两家都在笼络龙头券商，这次谁胜谁负？</p>\r\n            <br>\r\n            <p>此前，京东被爆收购第一创业24%股份，虽然被辟谣，但足以证明，互联网巨头对券商是真爱！随着巨头持续加入，券商股或迎破局之际。</p>\r\n            <br>\r\n            <p>不过，阿里苏宁这次增发价只有13块，比周五收盘价还低10%，卖的没有买的精，马爸爸果然会玩，一方面跟腾讯竞争，一方面抄了底，进可攻退可守。</p>\r\n            <br>\r\n            <p>券商股已经跌了3年，估值确实很低，但券商这种周期性行业，牛市才能暴动，但现在A股却是股灾，情何以堪！</p>\r\n            <br>\r\n            <p>必须要说，阿里炒A股水平很烂，买一个套一个，实在不敢恭维；倒是苏宁是“股神”，现在股神和菜鸟一起看上华泰，结局会如何呢？至少下周券商要暴动了。</p>\r\n            <br>\r\n            <p>去年腾讯入股中金，现在马云也杀进来了，阿里腾讯的战火，已经打到证券行业，两家都在笼络龙头券商，这次谁胜谁负？</p>\r\n            <br>\r\n            <p>此前，京东被爆收购第一创业24%股份，虽然被辟谣，但足以证明，互联网巨头对券商是真爱！随着巨头持续加入，券商股或迎破局之际。</p>\r\n            <br>\r\n            <p>不过，阿里苏宁这次增发价只有13块，比周五收盘价还低10%，卖的没有买的精，马爸爸果然会玩，一方面跟腾讯竞争，一方面抄了底，进可攻退可守。</p>\r\n            <br>\r\n            <p>券商股已经跌了3年，估值确实很低，但券商这种周期性行业，牛市才能暴动，但现在A股却是股灾，情何以堪！</p>\r\n            <br>\r\n            <p>必须要说，阿里炒A股水平很烂，买一个套一个，实在不敢恭维；倒是苏宁是“股神”，现在股神和菜鸟一起看上华泰，结局会如何呢？至少下周券商要暴动了。</p>', '', '1', '20180806114825');
INSERT INTO `xujm_cms_article` VALUES ('10', '9', 'zh_CN', '媒体：A股市盈率不足16倍完全符合底部特征', '媒体：A股市盈率不足16倍完全符合底部特征', '媒体：A股市盈率不足16倍完全符合底部特征', '<p>媒体头版刊文称，A股是中国经济缩影，也是优秀企业群体聚集地。数据表明，当前A股市盈率不足16倍，这一水平与2005年6月、2008年10月、2013年6月以及2016年1月四次底部时市盈率水平相近，完全符合底部时期特征。</p>\r\n            <br>\r\n            <p>现在A股市盈率16倍，比美股、日股都要低；但这只是表象，把银行股剔除，A股真实市盈率还很高；而且A股权重也不合理，工行中石油平安等占比过高，很容易拉低市盈率。</p>\r\n            <br>\r\n            <p>整体来看，A股市盈率中位数大概是30倍，尽管股市已创新低，但跟牛了10年的美股差不多，足见之前之畸高，而现在说见底言之过早，寻底还找不多。</p>\r\n            <br>\r\n            <p>很多人不理解，这个点位的A股，为何跑不过美股；其实很正常，且不说宏观经济和外部压力；就说A股财务造假、IPO乱象、市场情绪等，就足以让市场非理性宣泄。</p>\r\n            <br>\r\n            <p>现在A股市盈率16倍，比美股、日股都要低；但这只是表象，把银行股剔除，A股真实市盈率还很高；而且A股权重也不合理，工行中石油平安等占比过高，很容易拉低市盈率。</p>\r\n            <br>\r\n            <p>整体来看，A股市盈率中位数大概是30倍，尽管股市已创新低，但跟牛了10年的美股差不多，足见之前之畸高，而现在说见底言之过早，寻底还找不多。</p>\r\n            <br>\r\n            <p>很多人不理解，这个点位的A股，为何跑不过美股；其实很正常，且不说宏观经济和外部压力；就说A股财务造假、IPO乱象、市场情绪等，就足以让市场非理性宣泄。</p>\r\n            <br>\r\n            <p>现在A股市盈率16倍，比美股、日股都要低；但这只是表象，把银行股剔除，A股真实市盈率还很高；而且A股权重也不合理，工行中石油平安等占比过高，很容易拉低市盈率。</p>\r\n            <br>\r\n            <p>整体来看，A股市盈率中位数大概是30倍，尽管股市已创新低，但跟牛了10年的美股差不多，足见之前之畸高，而现在说见底言之过早，寻底还找不多。</p>\r\n            <br>\r\n            <p>很多人不理解，这个点位的A股，为何跑不过美股；其实很正常，且不说宏观经济和外部压力；就说A股财务造假、IPO乱象、市场情绪等，就足以让市场非理性宣泄。</p>\r\n            <br>\r\n            <p>现在A股市盈率16倍，比美股、日股都要低；但这只是表象，把银行股剔除，A股真实市盈率还很高；而且A股权重也不合理，工行中石油平安等占比过高，很容易拉低市盈率。</p>\r\n            <br>\r\n            <p>整体来看，A股市盈率中位数大概是30倍，尽管股市已创新低，但跟牛了10年的美股差不多，足见之前之畸高，而现在说见底言之过早，寻底还找不多。</p>\r\n            <br>\r\n            <p>很多人不理解，这个点位的A股，为何跑不过美股；其实很正常，且不说宏观经济和外部压力；就说A股财务造假、IPO乱象、市场情绪等，就足以让市场非理性宣泄。</p>', '', '1', '20180806114825');
INSERT INTO `xujm_cms_article` VALUES ('11', '10', 'zh_CN', '深交所：完善停牌制度停牌不再是重组必经之路', '深交所：完善停牌制度停牌不再是重组必经之路', '深交所：完善停牌制度停牌不再是重组必经之路', '<p>深交所表示，今年以来，深交所持续推进停复牌制度改革，坚决遏制“随意停”“任意停”“长期停”现象，切实维护投资者交易权、知情权等合法权益，在市场参与各方共同努力下，近期深市上市公司股票停牌家数明显减少，并购重组停复牌出现新变化。</p>\r\n            <br>\r\n            <p>停牌如果跟重组不挂钩，绝对是巨大利好！在现有机制下，很多公司利用假重组，申请停牌，实际上是随便找个朋友工厂，双方说好重组唱双簧；为躲避利空，最后就是股民亏死！</p>\r\n            <br>\r\n            <p>今年停牌确实少了，这个算进步，但钉子户不少，比如万达电影，许老板借壳的深深房A，更无力吐槽，停了整整2年，严重剥夺了股民交易权！</p>\r\n            <br>\r\n            <p>当然有人会问，说到随意停牌，不知道特停算不算？上周的成都路桥，斯太尔，天成控股...出来是挺快的，但都是一碗大面，对市场雪上加霜，这种停牌，希望越少越好。</p><br>\r\n            <p>停牌如果跟重组不挂钩，绝对是巨大利好！在现有机制下，很多公司利用假重组，申请停牌，实际上是随便找个朋友工厂，双方说好重组唱双簧；为躲避利空，最后就是股民亏死！</p>\r\n            <br>\r\n            <p>今年停牌确实少了，这个算进步，但钉子户不少，比如万达电影，许老板借壳的深深房A，更无力吐槽，停了整整2年，严重剥夺了股民交易权！</p>\r\n            <br>\r\n            <p>当然有人会问，说到随意停牌，不知道特停算不算？上周的成都路桥，斯太尔，天成控股...出来是挺快的，但都是一碗大面，对市场雪上加霜，这种停牌，希望越少越好。</p><br>\r\n            <p>停牌如果跟重组不挂钩，绝对是巨大利好！在现有机制下，很多公司利用假重组，申请停牌，实际上是随便找个朋友工厂，双方说好重组唱双簧；为躲避利空，最后就是股民亏死！</p>\r\n            <br>\r\n            <p>今年停牌确实少了，这个算进步，但钉子户不少，比如万达电影，许老板借壳的深深房A，更无力吐槽，停了整整2年，严重剥夺了股民交易权！</p>\r\n            <br>\r\n            <p>当然有人会问，说到随意停牌，不知道特停算不算？上周的成都路桥，斯太尔，天成控股...出来是挺快的，但都是一碗大面，对市场雪上加霜，这种停牌，希望越少越好。</p><br>\r\n            <p>停牌如果跟重组不挂钩，绝对是巨大利好！在现有机制下，很多公司利用假重组，申请停牌，实际上是随便找个朋友工厂，双方说好重组唱双簧；为躲避利空，最后就是股民亏死！</p>\r\n            <br>\r\n            <p>今年停牌确实少了，这个算进步，但钉子户不少，比如万达电影，许老板借壳的深深房A，更无力吐槽，停了整整2年，严重剥夺了股民交易权！</p>\r\n            <br>\r\n            <p>当然有人会问，说到随意停牌，不知道特停算不算？上周的成都路桥，斯太尔，天成控股...出来是挺快的，但都是一碗大面，对市场雪上加霜，这种停牌，希望越少越好。</p><br>\r\n            <p>停牌如果跟重组不挂钩，绝对是巨大利好！在现有机制下，很多公司利用假重组，申请停牌，实际上是随便找个朋友工厂，双方说好重组唱双簧；为躲避利空，最后就是股民亏死！</p>\r\n            <br>\r\n            <p>今年停牌确实少了，这个算进步，但钉子户不少，比如万达电影，许老板借壳的深深房A，更无力吐槽，停了整整2年，严重剥夺了股民交易权！</p>\r\n            <br>\r\n            <p>当然有人会问，说到随意停牌，不知道特停算不算？上周的成都路桥，斯太尔，天成控股...出来是挺快的，但都是一碗大面，对市场雪上加霜，这种停牌，希望越少越好。</p><br>\r\n            <p>停牌如果跟重组不挂钩，绝对是巨大利好！在现有机制下，很多公司利用假重组，申请停牌