INSERT INTO `xujm_cms_article` VALUES ('12', '2', 'en_US', '今年以来，A股市场行情低迷', '今年以来，A股市场行情低迷', '今年以来，A股市场行情低迷', '<p>深交所表示，今年以来，深交所持续推进停复牌制度改革，坚决遏制“随意停”“任意停”“长期停”现象，切实维护投资者交易权、知情权等合法权益，在市场参与各方共同努力下，近期深市上市公司股票停牌家数明显减少，并购重组停复牌出现新变化。</p>\r\n            <br>\r\n            <p>停牌如果跟重组不挂钩，绝对是巨大利好！在现有机制下，很多公司利用假重组，申请停牌，实际上是随便找个朋友工厂，双方说好重组唱双簧；为躲避利空，最后就是股民亏死！</p>\r\n            <br>\r\n            <p>今年停牌确实少了，这个算进步，但钉子户不少，比如万达电影，许老板借壳的深深房A，更无力吐槽，停了整整2年，严重剥夺了股民交易权！</p>\r\n            <br>\r\n            <p>当然有人会问，说到随意停牌，不知道特停算不算？上周的成都路桥，斯太尔，天成控股...出来是挺快的，但都是一碗大面，对市场雪上加霜，这种停牌，希望越少越好。</p><br>\r\n            <p>停牌如果跟重组不挂钩，绝对是巨大利好！在现有机制下，很多公司利用假重组，申请停牌，实际上是随便找个朋友工厂，双方说好重组唱双簧；为躲避利空，最后就是股民亏死！</p>\r\n            <br>\r\n            <p>今年停牌确实少了，这个算进步，但钉子户不少，比如万达电影，许老板借壳的深深房A，更无力吐槽，停了整整2年，严重剥夺了股民交易权！</p>\r\n            <br>\r\n            <p>当然有人会问，说到随意停牌，不知道特停算不算？上周的成都路桥，斯太尔，天成控股...出来是挺快的，但都是一碗大面，对市场雪上加霜，这种停牌，希望越少越好。</p><br>\r\n            <p>停牌如果跟重组不挂钩，绝对是巨大利好！在现有机制下，很多公司利用假重组，申请停牌，实际上是随便找个朋友工厂，双方说好重组唱双簧；为躲避利空，最后就是股民亏死！</p>\r\n            <br>\r\n            <p>今年停牌确实少了，这个算进步，但钉子户不少，比如万达电影，许老板借壳的深深房A，更无力吐槽，停了整整2年，严重剥夺了股民交易权！</p>\r\n            <br>\r\n            <p>当然有人会问，说到随意停牌，不知道特停算不算？上周的成都路桥，斯太尔，天成控股...出来是挺快的，但都是一碗大面，对市场雪上加霜，这种停牌，希望越少越好。</p><br>\r\n            <p>停牌如果跟重组不挂钩，绝对是巨大利好！在现有机制下，很多公司利用假重组，申请停牌，实际上是随便找个朋友工厂，双方说好重组唱双簧；为躲避利空，最后就是股民亏死！</p>\r\n            <br>\r\n            <p>今年停牌确实少了，这个算进步，但钉子户不少，比如万达电影，许老板借壳的深深房A，更无力吐槽，停了整整2年，严重剥夺了股民交易权！</p>\r\n            <br>\r\n            <p>当然有人会问，说到随意停牌，不知道特停算不算？上周的成都路桥，斯太尔，天成控股...出来是挺快的，但都是一碗大面，对市场雪上加霜，这种停牌，希望越少越好。</p><br>\r\n            <p>停牌如果跟重组不挂钩，绝对是巨大利好！在现有机制下，很多公司利用假重组，申请停牌，实际上是随便找个朋友工厂，双方说好重组唱双簧；为躲避利空，最后就是股民亏死！</p>\r\n            <br>\r\n            <p>今年停牌确实少了，这个算进步，但钉子户不少，比如万达电影，许老板借壳的深深房A，更无力吐槽，停了整整2年，严重剥夺了股民交易权！</p>\r\n            <br>\r\n            <p>当然有人会问，说到随意停牌，不知道特停算不算？上周的成都路桥，斯太尔，天成控股...出来是挺快的，但都是一碗大面，对市场雪上加霜，这种停牌，希望越少越好。</p><br>\r\n            <p>停牌如果跟重组不挂钩，绝对是巨大利好！在现有机制下，很多公司利用假重组，申请停牌，实际上是随便找个朋友工厂，双方说好重组唱双簧；为