INSERT INTO `xujm_cms_article` VALUES ('13', '3', 'en_US', '什么才是影响市场调整的核心因素？', '什么才是影响市场调整的核心因素？', '什么才是影响市场调整的核心因素？', '<p>什么才是影响市场调整的核心因素？在这样的调整市中，如何进行后市资产配置？面对诸多不确定性，哪些行业将受到较大影响，哪些产业能穿越熊市？ 现阶段市场已处于底部区域。</p>\r\n            <p>从估值和宏观政策方面来说都已到达比较低的位置，现在的估值离历史上最低的水平也相差不远。</p>\r\n            <p>现在市场正处于不断透支未来利空的阶段。</p>\r\n\r\n            <br>\r\n\r\n            <p>如果把一段熊市分为三阶段，第一阶段是反映过去利空，第二阶段是当下利空，第三阶段是未来利空，现在很多股票处于熊市第三阶段。</p>\r\n            <p>而且，在大盘真正见底之前应该有1000只股票已经见底了，而现在至少有100只股票已经见底了。就像陆续过河一样，等到有1000只左右股票过河，我相信大盘就真正见底了。</p>\r\n\r\n            <br>\r\n\r\n            <p>今年以来，A股市场行情低迷，上证综指从年初的3314点下跌至8月3日的2740点，跌幅17%。</p>\r\n            <p>中小创同样下跌严重，创业板指于8月3日创出1481点的调整新低，而去年最具赚钱效应的白马股也遭遇剧烈调整。</p>\r\n            <p>与此同时，政策面、消息面的各种变化也接踵而至，货币政策及财政政策出现调整、中美贸易摩擦动态不断、疫苗案扰动医药股的起伏波动……种种因素都在让市场急剧变化。</p>\r\n\r\n            <br>\r\n\r\n            <p>什么才是影响市场调整的核心因素？在这样的调整市中，如何进行后市资产配置？面对诸多不确定性，哪些行业将受到较大影响，哪些产业能穿越熊市？ 现阶段市场已处于底部区域。</p>\r\n            <p>从估值和宏观政策方面来说都已到达比较低的位置，现在的估值离历史上最低的水平也相差不远。</p>\r\n            <p>现在市场正处于不断透支未来利空的阶段。</p>\r\n\r\n            <br>\r\n\r\n            <p>如果把一段熊市分为三阶段，第一阶段是反映过去利空，第二阶段是当下利空，第三阶段是未来利空，现在很多股票处于熊市第三阶段。</p>\r\n            <p>而且，在大盘真正见底之前应该有1000只股票已经见底了，而现在至少有100只股票已经见底了。就像陆续过河一样，等到有1000只左右股票过河，我相信大盘就真正见底了。</p>\r\n\r\n            <br>\r\n\r\n            <p>今年以来，A股市场行情低迷，上证综指从年初的3314点下跌至8月3日的2740点，跌幅17%。</p>\r\n            <p>中小创同样下跌严重，创业板指于8月3日创出1481点的调整新低，而去年最具赚钱效应的白马股也遭遇剧烈调整。</p>\r\n            <p>与此同时，政策面、消息面的各种变化也接踵而至，货币政策及财政政策出现调整、中美贸易摩擦动态不断、疫苗案扰动医药股的起伏波动……种种因素都在让市场急剧变化。</p>', '', '1', '20180806114825');
INSERT INTO `xujm_cms_article` VALUES ('14', '4', 'en_US', '熊市三阶段', '熊市三阶段', '熊市三阶段', '<p>如果把一段熊市分为三阶段，第一阶段是反映过去利空，第二阶段是当下利空，第三阶段是未来利空，现在很多股票处于熊市第三阶段。</p>\r\n            <p>而且，在大盘真正见底之前应该有1000只股票已经见底了，而现在至少有100只股票已经见底了。就像陆续过河一样，等到有1000只左右股票过河，我相信大盘就真正见底了。</p>\r\n\r\n            <br>\r\n\r\n            <p>今年以来，A股市场行情低迷，上证综指从年初的3314点下跌至8月3日的2740点，跌幅17%。</p>\r\n            <p>中小创同样下跌严重，创业板指于8月3日创出1481点的调整新低，而去年最具赚钱效应的白马股也遭遇剧烈调整。</p>\r\n            <p>与此同时，政策面、消息面的各种变化也接踵而至，货币政策及财政政策出现调整、中美贸易摩擦动态不断、疫苗案扰动医药股的起伏波动……种种因素都在让市场急剧变化。</p>\r\n\r\n            <br>\r\n\r\n            <p>什么才是影响市场调整的核心因素？在这样的调整市中，如何进行后市资产配置？面对诸多不确定性，哪些行业将受到较大影响，哪些产业能穿越熊市？ 现阶段市场已处于底部区域。</p>\r\n            <p>从估值和宏观政策方面来说都已到达比较低的位置，现在的估值离历史上最低的水平也相差不远。</p>\r\n            <p>现在市场正处于不断透支未来利空的阶段。</p>\r\n\r\n            <br>\r\n\r\n            <p>如果把一段熊市分为三阶段，第一阶段是反映过去利空，第二阶段是当下利空，第三阶段是未来利空，现在很多股票处于熊市第三阶段。</p>\r\n            <p>而且，在大盘真正见底之前应该有1000只股票已经见底了，而现在至少有100只股票已经见底了。就像陆续过河一样，等到有1000只左右股票过河，我相信大盘就真正见底了。</p>\r\n\r\n            <br>\r\n\r\n            <p>今年以来，A股市场行情低迷，上证综指从年初的3314点下跌至8月3日的2740点，跌幅17%。</p>\r\n            <p>中小创同样下跌严重，创业板指于8月3日创出1481点的调整新低，而去年最具赚钱效应的白马股也遭遇剧烈调整。</p>\r\n            <p>与此同时，政策面、消息面的各种变化也接踵而至，货币政策及财政政策出现调整、中美贸易摩擦动态不断、疫苗案扰动医药股的起伏波动……种种因素都在让市场急剧变化。</p>\r\n\r\n            <br>\r\n\r\n            <p>什么才是影响市场调整的核心因素？在这样的调整市中，如何进行后市资产配置？面对诸多不确定性，哪些行业将受到较大影响，哪些产业能穿越熊市？ 现阶段市场已处于底部区域。</p>\r\n            <p>从估值和宏观政策方面来说都已到达比较低的位置，现在的估值离历史上最低的水平也相差不远。</p>\r\n            <p>现在市场正处于不断透支未来利空的阶段。</p>', '', '1', '20180806114825');
INSERT INTO `xujm_cms_article` VALUES ('15', '5', 'en_US', '重磅！国务院决定对美600亿美元商品加征GS', '重磅！国务院决定对美600亿美元商品加征GS', '重磅！国务院决定对美600亿美元商品加征GS', ' <p>8月3日晚间，经国务院批准，国务院GS税则委员会决定对原产于美国5207个税目约600亿美元商品，加征25%、20%、10%、5%不等的GS；如果美方一意孤行，将其加征GS措施付诸实施，中方将即行实施上述加征GS措施。</p>\r\n\r\n            <br>\r\n\r\n        　　<p>中国这次主动还击，出乎很多人意料，但以攻为守，算得上一招秒棋。</p>\r\n            <p>特朗普2000亿砸下来，我们不会措手不及！此外，也是一种警告，我们也会玩真的，别逼急了。</p>\r\n\r\n            <br>\r\n\r\n        　　<p>谈判本身就是心理战，如果我们一味示弱，就会失去谈判的筹码！这次不管川普是想敲诈，还是遏制中国走向大国之路；我们已经下定决心，宁可站着死，不愿跪着生，这是我们的坚定态度。</p>\r\n\r\n            <br>\r\n\r\n        　　<p>中美的毛衣战，不是我们希望的，但躲不过，只能迎战；虽然短期有阵痛，有可能有巨大损失，但从长远看，也许我们会庆幸，当初强力反击是多么重要；作为股民，虽然对毛衣战战战兢兢，但必须从大义出发，正面对待摩擦，不就亏点钱嘛，反正破罐子都摔了几百回了！</p>\r\n\r\n            <br>\r\n\r\n        　　<p>当然，咱们放出600亿这种大招，美股周五还全线飘红，A股却连创新低，编剧都不敢这样编，真是没有对比就不会揪心。</p>\r\n\r\n            <br>\r\n\r\n            <p>8月3日晚间，经国务院批准，国务院GS税则委员会决定对原产于美国5207个税目约600亿美元商品，加征25%、20%、10%、5%不等的GS；如果美方一意孤行，将其加征GS措施付诸实施，中方将即行实施上述加征GS措施。</p>\r\n\r\n            <br>\r\n\r\n        　　<p>中国这次主动还击，出乎很多人意料，但以攻为守，算得上一招秒棋。</p>\r\n            <p>特朗普2000亿砸下来，我们不会措手不及！此外，也是一种警告，我们也会玩真的，别逼急了。</p>\r\n\r\n            <br>\r\n\r\n        　　<p>谈判本身就是心理战，如果我们一味示弱，就会失去谈判的筹码！这次不管川普是想敲诈，还是遏制中国走向大国之路；我们已经下定决心，宁可站着死，不愿跪着生，这是我们的坚定态度。</p>\r\n\r\n            <br>\r\n\r\n        　　<p>中美的毛衣战，不是我们希望的，但躲不过，只能迎战；虽然短期有阵痛，有可能有巨大损失，但从长远看，也许我们会庆幸，当初强力反击是多么重要；作为股民，虽然对毛衣战战战兢兢，但必须从大义出发，正面对待摩擦，不就亏点钱嘛，反正破罐子都摔了几百回了！</p>\r\n\r\n            <br>\r\n\r\n        　　<p>当然，咱们放出600亿这种大招，美股周五还全线飘红，A股却连创新低，编剧都不敢这样编，真是没有对比就不会揪心。</p>\r\n\r\n            <br>\r\n\r\n        　　<p>中国这次主动还击，出乎很多人意料，但以攻为守，算得上一招秒棋。</p>\r\n            <p>特朗普2000亿砸下来，我们不会措手不及！此外，也是一种警告，我们也会玩真的，别逼急了。</p>\r\n\r\n            <br>\r\n\r\n        　　<p>谈判本身就是心理战，如果我们一味示弱，就会失去谈判的筹码！这次不管川普是想敲诈，还是遏制中国走向大国之路；我们已经下定决心，宁可站着死，不愿跪着生，这是我们的坚定态度。</p>\r\n\r\n            <br>\r\n\r\n        　　<p>中美的毛衣战，不是我们希望的，但躲不过，只能迎战；虽然短期有阵痛，有可能有巨大损失，但从长远看，也许我们会庆幸，当初强力反击是多么重要；作为股民，虽然对毛衣战战战兢兢，但必须从大义出发，正面对待摩擦，不就亏点钱嘛，反正破罐子都摔了几百回了！</p>\r\n\r\n            <br>\r\n\r