INSERT INTO `xujm_cms_article` VALUES ('16', '6', 'en_US', '央行出手：上调外汇风险准备金率至20%', '央行出手：上调外汇风险准备金率至20%', '央行出手：上调外汇风险准备金率至20%', '<p>8月3日，央行网站发布消息称，自2018年8月6日起，将远期售汇业务的外汇风险准备金率从0调整为20%！受此影响，人民币汇率闻风而动，离岸人民币连收六关，强势800点大反弹；在岸人民币低位反弹740点，收复6.83关口。</p>\r\n            <br>\r\n\r\n            <p>关键点位关键时刻，央行终于出手，将外汇风险准备金恢复至20%，抬高做空人民币成本，同时大行抛售打压美元，暴打空头一顿，人民币也报复性反弹。</p>\r\n            <br>\r\n\r\n            <p>可以预见，7是央行容忍底线，捍卫决心不需质疑，虽然护盘需要砸真金白银，有消耗外储的隐忧；但是7若被轻松洞穿，很可能会一泻千里，这个结果显然更糟。</p>\r\n            <br>\r\n\r\n            <p>央行开始干预汇率，也是为毛衣战未雨绸缪，保汇率最大的意义，就是稳住资金外逃压力，不把楼市暴露在打击范围内，毕竟这个泡沫戳破了，可能会引发核弹的后果。</p>\r\n            <br>\r\n\r\n            <p>同时，汇率稳定了，有利于缓解股市恐慌；今年人民币和股市，走的几乎一模一样，堪称难兄难弟，现在难兄要上岸了，难弟还能一直趴着吃土吗？</p>\r\n\r\n            <br>\r\n            \r\n            <p>关键点位关键时刻，央行终于出手，将外汇风险准备金恢复至20%，抬高做空人民币成本，同时大行抛售打压美元，暴打空头一顿，人民币也报复性反弹。</p>\r\n            <br>\r\n            \r\n            <p>可以预见，7是央行容忍底线，捍卫决心不需质疑，虽然护盘需要砸真金白银，有消耗外储的隐忧；但是7若被轻松洞穿，很可能会一泻千里，这个结果显然更糟。</p>\r\n            <br>\r\n            \r\n            <p>央行开始干预汇率，也是为毛衣战未雨绸缪，保汇率最大的意义，就是稳住资金外逃压力，不把楼市暴露在打击范围内，毕竟这个泡沫戳破了，可能会引发核弹的后果。</p>\r\n            <br>\r\n            \r\n            <p>同时，汇率稳定了，有利于缓解股市恐慌；今年人民币和股市，走的几乎一模一样，堪称难兄难弟，现在难兄要上岸了，难弟还能一直趴着吃土吗？</p>\r\n            <br>\r\n            \r\n            <p>关键点位关键时刻，央行终于出手，将外汇风险准备金恢复至20%，抬高做空人民币成本，同时大行抛售打压美元，暴打空头一顿，人民币也报复性反弹。</p>\r\n            <br>\r\n            \r\n            <p>可以预见，7是央行容忍底线，捍卫决心不需质疑，虽然护盘需要砸真金白银，有消耗外储的隐忧；但是7若被轻松洞穿，很可能会一泻千里，这个结果显然更糟。</p>\r\n            <br>\r\n            \r\n            <p>央行开始干预汇率，也是为毛衣战未雨绸缪，保汇率最大的意义，就是稳住资金外逃压力，不把楼市暴露在打击范围内，毕竟这个泡沫戳破了，可能会引发核弹的后果。</p>\r\n            <br>\r\n            \r\n            <p>同时，汇率稳定了，有利于缓解股市恐慌；今年人民币和股市，走的几乎一模一样，堪称难兄难弟，现在难兄要上岸了，难弟还能一直趴着吃土吗？</p>\r\n', '', '1', '20180806114825');
INSERT INTO `xujm_cms_article` VALUES ('17', '7', 'en_US', '证监会核发2家企业IPO批文筹资总额不超17亿', '证监会核发2家企业IPO批文筹资总额不超17亿', '证监会核发2家企业IPO批文筹资总额不超17亿', '<p>证监会周五晚间核发2家IPO批文，其中上交所主板1家（康辰药业）、深交所中小板1家（新兴装备），两家公司筹资总额不超过17亿元。</p>\r\n            <br>\r\n            <p>本周股市灰头土脸，很多人憧憬IPO暂停，结果由1家涨到2家，就是这么自信；两耳不闻窗外事，一心只把新股发；管你跌到几何时，我自坚持常态化！</p>\r\n            <br>\r\n            <p>所以，大盘下跌就暂缓IPO，想法太天真了；这周A股市值被日本超越，或许领导的想法是，还是发太少了，要多发几家，不就重新反超了嘛！</p>\r\n            <br>\r\n            <p>当然，IPO给股市下跌背锅，也有点冤；实际上，A股已经4个月每周没超过2家，今年到现在发了62家，去年是230多家，控制IPO速度，村长也尽力了。</p>\r\n            <br>\r\n            <p>但现在市场泥沙俱下，股民一片悲观，监管层打肿脸充胖子，真让人闹心，难道就不能为股市企稳让让步？虽然这周IPO募资不多，但2家足以激怒韭菜；不过，次新板块已经8连跌，再挖坑可能就是机会了！</p>\r\n            <br>\r\n            <p>本周股市灰头土脸，很多人憧憬IPO暂停，结果由1家涨到2家，就是这么自信；两耳不闻窗外事，一心只把新股发；管你跌到几何时，我自坚持常态化！</p>\r\n            <br>\r\n            <p>所以，大盘下跌就暂缓IPO，想法太天真了；这周A股市值被日本超越，或许领导的想法是，还是发太少了，要多发几家，不就重新反超了嘛！</p>\r\n            <br>\r\n            <p>当然，IPO给股市下跌背锅，也有点冤；实际上，A股已经4个月每周没超过2家，今年到现在发了62家，去年是230多家，控制IPO速度，村长也尽力了。</p>\r\n            <br>\r\n            <p>但现在市场泥沙俱下，股民一片悲观，监管层打肿脸充胖子，真让人闹心，难道就不能为股市企稳让让步？虽然这周IPO募资不多，但2家足以激怒韭菜；不过，次新板块已经8连跌，再挖坑可能就是机会了！</p>\r\n            <br>\r\n            <p>本周股市灰头土脸，很多人憧憬IPO暂停，结果由1家涨到2家，就是这么自信；两耳不闻窗外事，一心只把新股发；管你跌到几何时，我自坚持常态化！</p>\r\n            <br>\r\n            <p>所以，大盘下跌就暂缓IPO，想法太天真了；这周A股市值被日本超越，或许领导的想法是，还是发太少了，要多发几家，不就重新反超了嘛！</p>\r\n            <br>\r\n            <p>当然，IPO给股市下跌背锅，也有点冤；实际上，A股已经4个月每周没超过2家，今年到现在发了62家，去年是230多家，控制IPO速度，村长也尽力了。</p>\r\n            <br>\r\n            <p>但现在市场泥沙俱下，股民一片悲观，监管层打肿脸充胖子，真让人闹心，难道就不能为股市企稳让让步？虽然这周IPO募资不多，但2家足以激怒韭菜；不过，次新板块已经8连跌，再挖坑可能就是机会了！</p>\r\n            <br>\r\n            <p>本周股市灰头土脸，很多人憧憬IPO暂停，结果由1家涨到2家，就是这么自信；两耳不闻窗外事，一心只把新股发；管你跌到几何时，我自坚持常态化！</p>\r\n            <br>\r\n            <p>所以，大盘下跌就暂缓IPO，想法太天真了；这周A股市值被日本超越，或许领导的想法是，还是发太少了，要多发几家，不就重新反超了嘛！</p>\r\n            <br>\r\n            <p>当然，IPO给股市下跌背锅，也有点冤；实际上，A股已经4个月每周没超过2家，今年到现在发了62家，去年是230多家，控制IPO速度，村长也尽力了。</p>\r\n            <br>\r\n            <p>但