INSERT INTO `xujm_cms_article` VALUES ('21', '11', 'zh_CN', 'title', '各种Editor对比', '各种Editor对比', '<p>我用过以下Editor，做相关对比，（个人感觉，不同观点勿喷）。</p>\n\n<h3>KingEditor：</h3>\n\n<ul>\n	<li>优点：外观简洁，功能很清楚，plugin目录很清楚，代码很规范。用起来还是很不错的。</li>\n	<li>缺点：插入代码有问题，不能很好的可见即所得，就是感觉缺少点与时俱进的感觉。</li>\n</ul>\n\n<h3>CKEditor：</h3>\n\n<ul>\n	<li>优点：外观简介。（其实个人找不到什么优点，有可能我用的Editor比较多）。</li>\n	<li>缺点：繁重、JS引用很多，不是很了解的人，根本分不清楚那些是对自己有用，哪些是没用，没有想KingEditor那样每个plugin都一个目录，导致一些初学者引用很多JS，CSS，加载很慢。API不明确，各种Iframe，跨域。反正感觉各种不好用。</li>\n</ul>\n\n<h3>&nbsp;百度ueditor：</h3>\n\n<ul>\n	<li>优点：其实还不错，毕竟是大公司做出来的，外观、功能、多语言支持都很好，尤其是PHP。</li>\n	<li>缺点：繁重、耦合度很高，针对每个语言都做不同的版本，由于我是Java，百度的推广重心应该是PHP，所以Java方面比较弱，而且Java规则太多，比如我用的是Freemarker，改起来就费劲了，以Jar包的方式。我们需要改源码才能更好的使用，但是这样就费劲多了。</li>\n</ul>\n\n<h3>bootstrap-wysiwyg、simditor：</h3>\n\n<ul>\n	<li>为什么这2个放一起呢，因为都没有深入接触，bootstrap-wysiwyg，simditor都还不错，风格、一直有更新。</li>\n	<li>缺点：文档和资料方面CN版本较少，目前使用者较少。</li>\n</ul>\n\n<h3>wangEditor：</h3>\n\n<ul>\n	<li>缺点：缺少各种功能Demo，KingEditor这点做的很好。需要一定的功底方能更好的使用，好在作者代码注释写的很全。</li>\n	<li>优点：作者一直有更新，并且有QQ群： <strong>164999061，</strong>github，作者能及时的回答问题。有一点非常赞的一点，代码注释非常好。并且有区分开发和上线提示，并且判断Console日志输出。</li>\n</ul>\n\n<p>综合来说，如果你要选择，主要有以下几点判断：</p>\n\n<ol>\n	<li>功能全不全。</li>\n	<li>有没有人一直维护，更新。</li>\n	<li>耦和</li>\n	<li>使用的人多不多，资料多不多。</li>\n</ol>\n\n<p>ps：选择的时候，有时间的情况下，都使用一下吧。自己用过才有发言权。</p>\n', '', '1', '20180808143934');
INSERT INTO `xujm_cms_article` VALUES ('22', '12', 'zh_CN', '各种Editor对比', '各种Editor对比', '各种Editor对比', '<p>我用过以下Editor，做相关对比，（个人感觉，不同观点勿喷）。</p>\n\n<h3>KingEditor：</h3>\n\n<ul>\n	<li>优点：外观简洁，功能很清楚，plugin目录很清楚，代码很规范。用起来还是很不错的。</li>\n	<li>缺点：插入代码有问题，不能很好的可见即所得，就是感觉缺少点与时俱进的感觉。</li>\n</ul>\n\n<h3>CKEditor：</h3>\n\n<ul>\n	<li>优点：外观简介。（其实个人找不到什么优点，有可能我用的Editor比较多）。</li>\n	<li>缺点：繁重、JS引用很多，不是很了解的人，根本分不清楚那些是对自己有用，哪些是没用，没有想KingEditor那样每个plugin都一个目录，导致一些初学者引用很多JS，CSS，加载很慢。API不明确，各种Iframe，跨域。反正感觉各种不好用。</li>\n</ul>\n\n<h3>&nbsp;百度ueditor：</h3>\n\n<ul>\n	<li>优点：其实还不错，毕竟是大公司做出来的，外观、功能、多语言支持都很好，尤其是PHP。</li>\n	<li>缺点：繁重、耦合度很高，针对每个语言都做不同的版本，由于我是Java，百度的推广重心应该是PHP，所以Java方面比较弱，而且Java规则太多，比如我用的是Freemarker，改起来就费劲了，以Jar包的方式。我们需要改源码才能更好的使用，但是这样就费劲多了。</li>\n</ul>\n\n<h3>bootstrap-wysiwyg、simditor：</h3>\n\n<ul>\n	<li>为什么这2个放一起呢，因为都没有深入接触，bootstrap-wysiwyg，simditor都还不错，风格、一直有更新。</li>\n	<li>缺点：文档和资料方面CN版本较少，目前使用者较少。</li>\n</ul>\n\n<h3>wangEditor：</h3>\n\n<ul>\n	<li>缺点：缺少各种功能Demo，KingEditor这点做的很好。需要一定的功底方能更好的使用，好在作者代码注释写的很全。</li>\n	<li>优点：作者一直有更新，并且有QQ群： <strong>164999061，</strong>github，作者能及时的回答问题。有一点非常赞的一点，代码注释非常好。并且有区分开发和上线提示，并且判断Console日志输出。</li>\n</ul>\n\n<p>综合来说，如果你要选择，主要有以下几点判断：</p>\n\n<ol>\n	<li>功能全不全。</li>\n	<li>有没有人一直维护，更新。</li>\n	<li>耦和</li>\n	<li>使用的人多不多，资料多不多。</li>\n</ol>\n\n<p>ps：选择的时候，有时间的情况下，都使用一下吧。自己用过才有发言权。</p>\n', '', '0', '20180808145502');
INSERT INTO `xujm_cms_article` VALUES ('23', '13', 'zh_CN', '各种Editor对比', '各种Editor对比', '各种Editor对比', '<p>我用过以下Editor，做相关对比，（个人感觉，不同观点勿喷）。</p>\n\n<h3>KingEditor：</h3>\n\n<ul>\n	<li>优点：外观简洁，功能很清楚，plugin目录很清楚，代码很规范。用起来还是很不错的。</li>\n	<li>缺点：插入代码有问题，不能很好的可见即所得，就是感觉缺少点与时俱进的感觉。</li>\n</ul>\n\n<h3>CKEditor：</h3>\n\n<ul>\n	<li>优点：外观简介。（其实个人找不到什么优点，有可能我用的Editor比较多）。</li>\n	<li>缺点：繁重、JS引用很多，不是很了解的人，根本分不清楚那些是对自己有用，哪些是没用，没有想KingEditor那样每个plugin都一个目录，导致一些初学者引用很多JS，CSS，加载很慢。API不明确，各种Iframe，跨域。反正感觉各种不好用。</li>\n</ul>\n\n<h3>&nbsp;百度ueditor：</h3>\n\n<ul>\n	<li>优点：其实还不错，毕竟是大公司做出来的，外观、功能、多语言支持都很好，尤其是PHP。</li>\n	<li>缺点：繁重、耦合度很高，针对每个语言都做不同的版本，由于我是Java，百度的推广重心应该是PHP，所以Java方面比较弱，而且Java规则太多，比如我用的是Freemarker，改起来就费劲了，以Jar包的方式。我们需要改源码才能更好的使用，但是这样就费劲多了。</li>\n</ul>\n\n<h3>bootstrap-wysiwyg、simditor：</h3>\n\n<ul>\n	<li>为什么这2个放一起呢，因为都没有深入接触，bootstrap-wysiwyg，simditor都还不错，风格、一直有更新。</li>\n	<li>缺点：文档和资料方面CN版本较少，目前使用者较少。</li>\n</ul>\n\n<h3>wangEditor：</h3>\n\n<ul>\n	<li>缺点：缺少各种功能Demo，KingEditor这点做的很好。需要一定的功底方能更好的使用，好在作者代码注释写的很全。</li>\n	<li>优点：作者一直有更新，并且有QQ群： <strong>164999061，</strong>github，作者能及时的回答问题。有一点非常赞的一点，代码注释非常好。并且有区分开发和上线提示，并且判断Console日志输出。</li>\n</ul>\n\n<p>综合来说，如果你要选择，主要有以下几点判断：</p>\n\n<ol>\n	<li>功能全不全。</li>\n	<li>有没有人一直维护，更新。</li>\n	<li>耦和</li>\n	<li>使用的人多不多，资料多不多。</li>\n</ol>\n\n<p>ps：选择的时候，有时间的情况下，都使用一下吧。自己用过才有发言权。</p>\n', '', '1', '20180808151253');
INSERT INTO `xujm_cms_article` VALUES ('24', '14', 'zh_CN', '今年以来，A股市场行情低迷', '今年以来，A股市场行情低迷', '今年以来，A股市场行情低迷', '<p>今年以来，A股市场行情低迷，上证综指从年初的3314点下跌至8月3日的2740点，跌幅17%。</p>\n\n<p>中小创同样下跌严重，创业板指于8月3日创出1481点的调整新低，而去年最具赚钱效应的白马股也遭遇剧烈调整。</p>\n\n<p>与此同时，政策面、消息面的各种变化也接踵而至，货币政策及财政政策出现调整、中美贸易摩擦动态不断、疫苗案扰动医药股的起伏波动&hellip;&hellip;种种因素都在让市场急剧变化。</p>\n\n<p>&nbsp;</p>\n\n<p>什么才是影响市场调整的核心因素？在这样的调整市中，如何进行后市资产配置？面对诸多不确定性，哪些行业将受到较大影响，哪些产业能穿越熊市？ 现阶段市场已处于底部区域。</p>\n\n<p>从估值和宏观政策方面来说都已到达比较低的位置，现在的估值离历史上最低的水平也相差不远。</p>\n\n<p>现在市场正处于不断透支未来利空的阶段。</p>\n\n<p>&nbsp;</p>\n\n<p>如果把一段熊市分为三阶段，第一阶段是反映过去利空，第二阶段是当下利空，第三阶段是未来利空，现在很多股票处于熊市第三阶段。</p>\n\n<p>而且，在大盘真正见底之前应该有1000只股票已经见底了，而现在至少有100只股票已经见底了。就像陆续过河一样，等到有1000只左右股票过河，我相信大盘就真正见底了。</p>\n\n<p>&nbsp;</p>\n\n<p>今年以来，A股市场行情低迷，上证综指从年初的3314点下跌至8月3日的2740点，跌幅17%。</p>\n\n<p>中小创同样下跌严重，创业板指于8月3日创出1481点的调整新低，而去年最具赚钱效应的白马股也遭遇剧烈调整。</p>\n\n<p>与此同时，政策面、消息面的各种变化也接踵而至，货币政策及财政政策出现调整、中美贸易摩擦动态不断、疫苗案扰动医药股的起伏波动&hellip;&hellip;种种因素都在让市场急剧变化。</p>\n\n<p>&nbsp;</p>\n\n<p>什么才是影响市场调整的核心因素？在这样的调整市中，如何进行后市资产配置？面对诸多不确定性，哪些行业将受到较大影响，哪些产业能穿越熊市？ 现阶段市场已处于底部区域。</p>\n\n<p>从估值和宏观政策方面来说都已到达比较低的位置，现在的估值离历史上最低的水平也相差不远。</p>\n\n<p>现在市场正处于不断透支未来利空的阶段。</p>\n\n<p>&nbsp;</p>\n\n<p>如果把一段熊市分为三阶段，第一阶段是反映过去利空，第二阶段是当下利空，第三阶段是未来利空，现在很多股票处于熊市第三阶段。</p>\n\n<p>而且，在大盘真正见底之前应该有1000只股票已经见底了，而现在至少有100只股票已经见底了。就像陆续过河一样，等到有1000只左右股票过河，我相信大盘就真正见底了。</p>\n', '', '1', '20180808151354');
INSERT INTO `xujm_cms_article` VALUES ('25', '15', 'zh_CN', '测试', '测试', '测试', '<p>新浪财经讯 &nbsp;8月8日消息，今日两市小幅低开后，一路震荡下行，创业板指大跌逾2%，采掘服务板块再度全天领涨两市，成护盘主力军，尾盘各大股指跌幅有所扩大，两市个股跌多涨少，避险情绪显著上升，截止收盘，沪指报2744.07点，跌1.27%，深成指报8499.22点，跌2.02%，创指报1447.76点，跌2.14%。</p>\n\n<p>　　从盘面上看，水泥、采掘服务、可燃冰居板块涨幅榜前列，集成电路、次新股、芯片概念居板块跌幅榜前列。</p>\n\n<p>　　新浪财经首席评论员老艾<a class=\"wt_article_link\" href=\"http://weibo.com/aitangming?zw=finance\" target=\"_blank\">[微博]</a>表示， 今天下跌是几大因素共振结果：一是昨天大涨获利盘的抛售压力。二是美国将对160亿美元中国产品征收25%的额外关税。三是上午公布的进出口贸易数据不理想。另外国家队强拉权重股神助攻，反而起到负面作用。我们能做的就是耐心等待大盘稳定之后，下一次反弹机会的到来。</p>\n\n<p>&nbsp;</p>\n', '', '1', '20180808171206');
INSERT INTO `xujm_cms_article` VALUES ('26', '16', 'zh_CN', '测试2', '测试2', '测试2', '<div>创业板60分钟浪形分析：</div>\n\n<div>市场在昨天大涨之后，今天放量下跌，创业板跌幅最大，，底部区域的涨跌历来如此。</div>\n\n<div>&nbsp;</div>\n\n<div>技术分析如图所示：</div>\n\n<div>先说创业板：昨天大涨之后，创业板今天出现放量阴包阳走势，再度打击市场人气。我的判断不变这里就是底部区域，底部k线组合也经常出现这种大开大合的形态，阳包阴，阴包阳。今天午间分析中也提示关注创业板1452支撑，收盘跌破了，那么创业板明天还有新低产生。参考今天图表，1645这波下跌，3浪出现细分推动，昨天的反弹是4浪反弹，还有一个5浪低点。注意明天也是创业板1918波段下跌的第89天日线级别时间窗口，倾向于明天见低点。最迟本周五也会拉起。无论是1918高点，还是1645高点的下跌，5浪结构都已经非常清晰了，这里我不过度看空。</div>\n', '', '1', '20180808171341');
INSERT INTO `xujm_cms_article` VALUES ('27', '17', 'zh_CN', '测试3', '测试3', '测试3', '<div>&nbsp;</div>\n\n<div>相比创业板，上证指数今天的跌幅还在合理范围之内，明天注意上证2725支撑，不破继续反弹，破则和创业板一样，去破2691-2692的所谓双底。昨天也说了一句，中国股市历史上很少有大底部出现所谓双底形态，往往尖底居多。</div>\n\n<div>综合判断，市场在之前经历了大幅下跌之后，这里是磨底走势，至少我个人的分析和操作，在这个位置不再过度看空了，而是在下跌中寻找可能的机会。</div>\n\n<div>&nbsp;</div>\n\n<div>今天股票盘口极差，还是总体的老热点油气改革板块上榜，中小创题材板块杀跌，次新板块跌幅第一。主观判断，前期领涨的基建水泥包括这两天领涨的油气板块，明天要出现调整走势，权重板块的上涨也是交替运行的节奏。</div>\n\n<div>这几天最大的问题就是没有新的热点出现，能激发市场人气的科技板块今天依然在调整中，明天创业板新低后看有无板块启动，这里一定要有新的热点出现。</div>\n', '', '1', '20180808171440');
INSERT INTO `xujm_cms_article` VALUES ('28', '18', 'zh_CN', '如何成为一个内心强大的人？', '如何成为一个内心强大的人？', '如何成为一个内心强大的人？', '<p>弱者普遍易怒如虎，而且容易暴怒。强者通常平静如水，并且相对平和。一个<a href=\"http://www.duwenzhang.com/huati/neixin/index1.html\">内心</a>不强大的人，自然内心不够平静。内心不平静的人，处处是风浪。再小的事，都会被无限放大。一个内心不强大的人，心中永远缺乏安全感。</p>\n\n<p><img alt=\"\" src=\"http://p.triplegain.chidaotv.com/cms/2018/08/16/153442061843512og.jpg\" style=\"height:250px; width:524px\" /></p>\n\n<p>　　不够强大，意味着很容易受到外界的影响，通常表现为：要么特别在意别人的看法，要么活在他人的眼目口舌之中。从而<a href=\"http://www.duwenzhang.com/huati/shiqu/index1.html\">失去</a>独立的判断能力，变得摇摆不定和坐立不安。</p>\n\n<p>　　要想成为一个内心强大的人，需要具备至少以下六大品质特征：1）高度自律和自黑；2）必须经历<a href=\"http://www.duwenzhang.com/huati/juewang/index1.html\">绝望</a>；3）培养独处的能力；4）不设限的思考；5）需要一个信仰；6）BE YOURSELF（做自己）。</p>\n\n<p>　　1。 高度自律和自黑</p>\n\n<p>　　为什么不说<a href=\"http://www.duwenzhang.com/huati/zixin/index1.html\">自信</a>呢？不自信的人，普遍内心比较<a href=\"http://www.duwenzhang.com/huati/cuiruo/index1.html\">脆弱</a>。一个自信的人，对自己充满信心，做事往往带着积极向上的力量，并时刻充满激情。所有的盲目自信，和空腹自信，都是自以为是。心中要有真才实学，哪怕在不断的试错，但终究能到达攀登高峰的那一天。</p>\n\n<p>　　人的自信到底从何而来？以及如何培养自己的自信？高度的自信，从高度的自律而来。自律又是什么？自律就是自己管理自己，自己约束自己。这是一个很重要的能力。先学会克制自己，用严格的日程表来控制<a href=\"http://www.duwenzhang.com/wenzhang/shenghuosuibi/\">生活</a>，才能在这种自律中不断磨练出自信。自信也代表着对事情的控制能力，连最基本的<a href=\"http://www.duwenzhang.com/huati/shijian/index1.html\">时间</a>都控制不了，谈何自信？</p>\n\n<p>　　除了自律以外，自黑的能力也相当重要。世界之大，什么鸟都有。等你哪一天稍微做出点成绩，很多认识或不认识的人便在背后，唧唧歪歪的议论是非。从最开始的吐槽，到断章取义的论断甚至无趣的黑你。</p>\n\n<p>　　自黑就是自己嘲笑自己，自己黑色幽默自己。自黑是一种沟通方式，也是一种境界，更是一种另类的<a href=\"http://www.duwenzhang.com/wenzhang/renshengzheli/20080818/15697.html\">修养</a>。自黑不是等到有人说你时才出现，而是从头到尾都需要有的能力。你必须看透那些<a href=\"http://www.duwenzhang.com/huati/wuliao/index1.html\">无聊</a>恶俗的人，要比他们还会擅长黑自己，待他们自知无趣后，便会羞愧的退场而去。</p>\n\n<p>　　2。 必须经历绝望</p>\n\n<p>　　经历绝望的意思，就是已经走过这段岁月。也许你还未曾绝望过，并不意味着你不<a href=\"http://www.duwenzhang.com/huati/jianqiang/index1.html\">坚强</a>，但一定没有经历过绝望的人坚强。未绝望过的<a href=\"http://www.duwenzhang.com/wenzhang/renshengzheli/\">人生</a>是不<a href=\"http://www.duwenzhang.com/huati/wanmei/index1.html\">完美</a>的人生。绝望可能是<a href=\"http://www.duwenzhang.com/\">情感</a>、<a href=\"http://www.duwenzhang.com/huati/shiye/index1.html\">事业</a>抑或无法面对的<a href=\"http://www.duwenzhang.com/huati/gudu/index1.html\">孤独</a>等等。</p>\n\n<p>　　「必须」 是一个前缀词，一个重要的状态。「必须」并非主动选择，而是做好充分的心理准备。当绝望来临时，坦然无惧的接受它，即使当下极其<a href=\"http://www.duwenzhang.com/huati/tongku/index1.html\">痛苦</a>，甚至失去了自我。在绝望中寻找<a href=\"http://www.duwenzhang.com/huati/xiwang/index1.html\">希望</a>，才是值得体验的一种人生。</p>\n\n<p>　　强大的人不是征服什么，而是能承受什么。一些事情，只有经历过了，才能明白其中的道理，和懂得人生的真谛。绝望并不可怕，可怕的是失去<a href=\"http://www.duwenzhang.com/huati/yongqi/index1.html\">勇气</a>和激情。经历绝望，但不要被绝望吞噬。相反你要胜过它，如同战胜黑暗，迎接光明一样。</p>\n\n<p>　　3。 培养独处的能力</p>\n\n<p>　　孤独和独处并不是一件事，是两码事，而且经常会被混淆。人们往往把交往看作一种能力，却忽略了独处也是一种能力，并且在一定意义上是比交往更为重要的一种能力。如果说不擅交际是一种<a href=\"http://www.duwenzhang.com/huati/xingge/index1.html\">性格</a>的弱点，那么，不耐孤独就简直是一种<a href=\"http://www.duwenzhang.com/huati/linghun/index1.html\">灵魂</a>的缺陷了。</p>\n\n<p>　　要耐得住<a href=\"http://www.duwenzhang.com/huati/jimo/index1.html\">寂寞</a>，不随波逐流。<a href=\"http://www.duwenzhang.com/huati/gudan/index1.html\">孤单</a>是一个人的狂欢，狂欢是一群人的孤单。所谓的<a href=\"http://www.duwenzhang.com/huati/chengshu/index1.html\">成熟</a>，就是你越长大，越能学会一个人适应一切。在独处的时光中，找到自己真正热爱的，并培养自己独立的判断能力。</p>\n\n<p>　　人只有先学会爱自己，才有能力爱他人。如果你不学着与自己对话，便更难和别人交流。越能独处的人，越能面对和理解困境，也越能与他人相处。因为能瞬间换位思考，更能设身处地为对方着想。</p>\n\n<p>　　4。 不设限的思考</p>\n\n<p>　　你的眼光要比别人远，你的心胸要比他人宽广。天天算计的人生，未来迟早也会被人生算计。除此以外，还活在各种小心眼和小格局之中。</p>\n\n<p>　　人生如同开车一样，当你比别人快30码，你体会到的感受别人无法感知。人生又如同开飞机，当你比别人高30000英尺，你看到的视野自然不同于他人。意思就是，当你在<a href=\"http://www.duwenzhang.com/huati/zhuiqiu/index1.html\">追求</a>更高更远的美景时，也就不必在意他人短视的眼目。一切自然云淡风轻，不再受影响。</p>\n\n<p>　　宽阔之后，就不会受狭隘主义的捆绑。<a href=\"http://www.duwenzhang.com/huati/ziyou/index1.html\">自由</a>之后，就不会受形式主义的限制。</p>\n\n<p>　　5。 需要一个信仰</p>\n\n<p>　　人实在太有限，不论你信仰什么，总归要有一个信仰，否则和动物无任何区别。</p>\n\n<p>　　在这个时代，几乎人人都有信仰，只是各自的信仰不同而已。有人信仰权力，有人信仰<a href=\"http://www.duwenzhang.com/huati/jinqian/index1.html\">金钱</a>，有人信仰自我，有人信仰<a href=\"http://www.duwenzhang.com/wenzhang/aiqingwenzhang/\">爱情</a>，有人信仰<a href=\"http://www.duwenzhang.com/huati/xingfu/index1.html\">幸福</a>，有人信仰美食，有人信仰党派，有人信仰制度，有人信仰无神，有人信仰有神，有人信仰多神，有人笃信基督&hellip;&hellip;</p>\n\n<p>　　不管什么样的信仰，都令人值得尊重，而且任何信仰都需要深入了解并<a href=\"http://www.duwenzhang.com/huati/xiangxin/index1.html\">相信</a>，才能称之为信仰。任何一种信仰，如果是稀里糊涂的信，都称不上信仰，属于迷信，包括基督教在内的所有宗教信仰。</p>\n\n<p>　　智慧和真理，有着天与地的距离。学会渴慕真理胜过追求智慧。真理能使人更有智慧的来看待世间万物，<a href=\"http://www.duwenzhang.com/huati/kuanrong/index1.html\">宽容</a>的<a href=\"http://www.duwenzhang.com/huati/taidu/index1.html\">态度</a>面对错综复杂的人际关系，无比坚定的<a href=\"http://www.duwenzhang.com/huati/xinnian/index1.html\">信念</a>奔走人生之路，从容淡定的直面<a href=\"http://www.duwenzhang.com/huati/renxing/index1.html\">人性</a>的黑暗和世间的悲剧。</p>\n\n<p>　　6。 BE YOURSELF（做自己）</p>\n\n<p>　　JUST BE YOURSELF。 不要试图取悦所有人，现在做不到，未来也做不到。</p>\n\n<p>　　人不可能面面俱到。每个人应该会有自己最在乎的人，他们才是你<a href=\"http://www.duwenzhang.com/huati/shengming/index1.html\">生命</a>中最宝贵的财富。倘若他们对你所做的事有误解或质疑，值得你花时间去回应和解释。</p>\n\n<p>　　以下是个人最在乎的三类群体，仅供参考：1、家人（亲戚不算在内，一年到头只见一回，并不清楚你的人生定位）；2、人生<a href=\"http://www.duwenzhang.com/huati/zhiji/index1.html\">知己</a>（为数不多的真正挚友，一切都知根知底）；3、牧师或导师（属灵上的导师，和职场中的前辈引领者）。</p>\n\n<p>　　他们的评价/意见/建议，则会认真的聆听。若存在不理解时，一定会充分的解释和回应。只有真正在乎的人相对全面了解你，其他人大部分是片面的认知。在生活中也没有特别的交集，有的只是道听途说或仅仅是几面之缘而已。</p>\n\n<p>　　不必回应那些熟悉的陌生人，他们并不一定真正关心你，更多的只是好奇宝宝。时间如此宝贵，无暇顾及这些，也不在解释的义务范畴。你的人生并不需要活在他人的言语中，还有很多更重要的事等着去做。</p>\n\n<p>　　内心强大的人，很少在意他人的看法，包括熟悉的陌生人。就像积极的人很少关注消极的信息，即便看到，也自动瞬间被屏蔽或消化。他们很清楚自己的定位和追求。</p>\n\n<p>　　遇到了障碍，会想尽一切办法铲除。遇到了<a href=\"http://www.duwenzhang.com/huati/cuozhe/index1.html\">挫折</a>，也不轻易<a href=\"http://www.duwenzhang.com/huati/fangqi/index1.html\">放弃</a>倒下。克服了困难，便<a href=\"http://www.duwenzhang.com/huati/yongyou/index1.html\">拥有</a>了力量。解决了问题，便拥有了智慧。走出了黑暗，便拥有了希望。对他们而言，这些仅仅是人生的必经之路。</p>\n\n<p>　　真正内心强大的人，一定有一颗平静的内心，有一颗温柔的心肠，有一颗智慧的头脑。一定经历过狂风暴雨，体验过高山低谷，也见识过人生百态。惟愿我们在人生的道路上，不论何种境遇都能充满智慧的刚强壮胆，成为内心强大的人。</p>\n', '', '1', '20180816195739');
INSERT INTO `xujm_cms_article` VALUES ('29', '18', 'en_US', '如何成为一个内心强大的人？', '如何成为一个内心强大的人？', '如何成为一个内心强大的人？', '<p>弱者普遍易怒如虎，而且容易暴怒。强者通常平静如水，并且相对平和。一个<a href=\"http://www.duwenzhang.com/huati/neixin/index1.html\">内心</a>不强大的人，自然内心不够平静。内心不平静的人，处处是风浪。再小的事，都会被无限放大。一个内心不强大的人，心中永远缺乏安全感。</p>\n\n<p><img alt=\"\" src=\"http://p.triplegain.chidaotv.com/cms/2018/08/16/153442061843512og.jpg\" style=\"height:250px; width:524px\" /></p>\n\n<p>　　不够强大，意味着很容易受到外界的影响，通常表现为：要么特别在意别人的看法，要么活在他人的眼目口舌之中。从而<a href=\"http://www.duwenzhang.com/huati/shiqu/index1.html\">失去</a>独立的判断能力，变得摇摆不定和坐立不安。</p>\n\n<p>　　要想成为一个内心强大的人，需要具备至少以下六大品质特征：1）高度自律和自黑；2）必须经历<a href=\"http://www.duwenzhang.com/huati/juewang/index1.html\">绝望</a>；3）培养独处的能力；4）不设限的思考；5）需要一个信仰；6）BE YOURSELF（做自己）。</p>\n\n<p>　　1。 高度自律和自黑</p>\n\n<p>　　为什么不说<a href=\"http://www.duwenzhang.com/huati/zixin/index1.html\">自信</a>呢？不自信的人，普遍内心比较<a href=\"http://www.duwenzhang.com/huati/cuiruo/index1.html\">脆弱</a>。一个自信的人，对自己充满信心，做事往往带着积极向上的力量，并时刻充满激情。所有的盲目自信，和空腹自信，都是自以为是。心中要有真才实学，哪怕在不断的试错，但终究能到达攀登高峰的那一天。</p>\n\n<p>　　人的自信到底从何而来？以及如何培养自己的自信？高度的自信，从高度的自律而来。自律又是什么？自律就是自己管理自己，自己约束自己。这是一个很重要的能力。先学会克制自己，用严格的日程表来控制<a href=\"http://www.duwenzhang.com/wenzhang/shenghuosuibi/\">生活</a>，才能在这种自律中不断磨练出自信。自信也代表着对事情的控制能力，连最基本的<a href=\"http://www.duwenzhang.com/huati/shijian/index1.html\">时间</a>都控制不了，谈何自信？</p>\n\n<p>　　除了自律以外，自黑的能力也相当重要。世界之大，什么鸟都有。等你哪一天稍微做出点成绩，很多认识或不认识的人便在背后，唧唧歪歪的议论是非。从最开始的吐槽，到断章取义的论断甚至无趣的黑你。</p>\n\n<p>　　自黑就是自己嘲笑自己，自己黑色幽默自己。自黑是一种沟通方式，也是一种境界，更是一种另类的<a href=\"http://www.duwenzhang.com/wenzhang/renshengzheli/20080818/15697.html\">修养</a>。自黑不是等到有人说你时才出现，而是从头到尾都需要有的能力。你必须看透那些<a href=\"http://www.duwenzhang.com/huati/wuliao/index1.html\">无聊</a>恶俗的人，要比他们还会擅长黑自己，待他们自知无趣后，便会羞愧的退场而去。</p>\n\n<p>　　2。 必须经历绝望</p>\n\n<p>　　经历绝望的意思，就是已经走过这段岁月。也许你还未曾绝望过，并不意味着你不<a href=\"http://www.duwenzhang.com/huati/jianqiang/index1.html\">坚强</a>，但一定没有经历过绝望的人坚强。未绝望过的<a href=\"http://www.duwenzhang.com/wenzhang/renshengzheli/\">人生</a>是不<a href=\"http://www.duwenzhang.com/huati/wanmei/index1.html\">完美</a>的人生。绝望可能是<a href=\"http://www.duwenzhang.com/\">情感</a>、<a href=\"http://www.duwenzhang.com/huati/shiye/index1.html\">事业</a>抑或无法面对的<a href=\"http://www.duwenzhang.com/huati/gudu/index1.html\">孤独</a>等等。</p>\n\n<p>　　「必须」 是一个前缀词，一个重要的状态。「必须」并非主动选择，而是做好充分的心理准备。当绝望来临时，坦然无惧的接受它，即使当下极其<a href=\"http://www.duwenzhang.com/huati/tongku/index1.html\">痛苦</a>，甚至失去了自我。在绝望中寻找<a href=\"http://www.duwenzhang.com/huati/xiwang/index1.html\">希望</a>，才是值得体验的一种人生。</p>\n\n<p>　　强大的人不是征服什么，而是能承受什么。一些事情，只有经历过了，才能明白其中的道理，和懂得人生的真谛。绝望并不可怕，可怕的是失去<a href=\"http://www.duwenzhang.com/huati/yongqi/index1.html\">勇气</a>和激情。经历绝望，但不要被绝望吞噬。相反你要胜过它，如同战胜黑暗，迎接光明一样。</p>\n\n<p>　　3。 培养独处的能力</p>\n\n<p>　　孤独和独处并不是一件事，是两码事，而且经常会被混淆。人们往往把交往看作一种能力，却忽略了独处也是一种能力，并且在一定意义上是比交往更为重要的一种能力。如果说不擅交际是一种<a href=\"http://www.duwenzhang.com/huati/xingge/index1.html\">性格</a>的弱点，那么，不耐孤独就简直是一种<a href=\"http://www.duwenzhang.com/huati/linghun/index1.html\">灵魂</a>的缺陷了。</p>\n\n<p>　　要耐得住<a href=\"http://www.duwenzhang.com/huati/jimo/index1.html\">寂寞</a>，不随波逐流。<a href=\"http://www.duwenzhang.com/huati/gudan/index1.html\">孤单</a>是一个人的狂欢，狂欢是一群人的孤单。所谓的<a href=\"http://www.duwenzhang.com/huati/chengshu/index1.html\">成熟</a>，就是你越长大，越能学会一个人适应一切。在独处的时光中，找到自己真正热爱的，并培养自己独立的判断能力。</p>\n\n<p>　　人只有先学会爱自己，才有能力爱他人。如果你不学着与自己对话，便更难和别人交流。越能独处的人，越能面对和理解困境，也越能与他人相处。因为能瞬间换位思考，更能设身处地为对方着想。</p>\n\n<p>　　4。 不设限的思考</p>\n\n<p>　　你的眼光要比别人远，你的心胸要比他人宽广。天天算计的人生，未来迟早也会被人生算计。除此以外，还活在各种小心眼和小格局之中。</p>\n\n<p>　　人生如同开车一样，当你比别人快30码，你体会到的感受别人无法感知。人生又如同开飞机，当你比别人高30000英尺，你看到的视野自然不同于他人。意思就是，当你在<a href=\"http://www.duwenzhang.com/huati/zhuiqiu/index1.html\">追求</a>更高更远的美景时，也就不必在意他人短视的眼目。一切自然云淡风轻，不再受影响。</p>\n\n<p>　　宽阔之后，就不会受狭隘主义的捆绑。<a href=\"http://www.duwenzhang.com/huati/ziyou/index1.html\">自由</a>之后，就不会受形式主义的限制。</p>\n\n<p>　　5。 需要一个信仰</p>\n\n<p>　　人实在太有限，不论你信仰什么，总归要有一个信仰，否则和动物无任何区别。</p>\n\n<p>　　在这个时代，几乎人人都有信仰，只是各自的信仰不同而已。有人信仰权力，有人信仰<a href=\"http://www.duwenzhang.com/huati/jinqian/index1.html\">金钱</a>，有人信仰自我，有人信仰<a href=\"http://www.duwenzhang.com/wenzhang/aiqingwenzhang/\">爱情</a>，有人信仰<a href=\"http://www.duwenzhang.com/huati/xingfu/index1.html\">幸福</a>，有人信仰美食，有人信仰党派，有人信仰制度，有人信仰无神，有人信仰有神，有人信仰多神，有人笃信基督&hellip;&hellip;</p>\n\n<p>　　不管什么样的信仰，都令人值得尊重，而且任何信仰都需要深入了解并<a href=\"http://www.duwenzhang.com/huati/xiangxin/index1.html\">相信</a>，才能称之为信仰。任何一种信仰，如果是稀里糊涂的信，都称不上信仰，属于迷信，包括基督教在内的所有宗教信仰。</p>\n\n<p>　　智慧和真理，有着天与地的距离。学会渴慕真理胜过追求智慧。真理能使人更有智慧的来看待世间万物，<a href=\"http://www.duwenzhang.com/huati/kuanrong/index1.html\">宽容</a>的<a href=\"http://www.duwenzhang.com/huati/taidu/index1.html\">态度</a>面对错综复杂的人际关系，无比坚定的<a href=\"http://www.duwenzhang.com/huati/xinnian/index1.html\">信念</a>奔走人生之路，从容淡定的直面<a href=\"http://www.duwenzhang.com/huati/renxing/index1.html\">人性</a>的黑暗和世间的悲剧。</p>\n\n<p>　　6。 BE YOURSELF（做自己）</p>\n\n<p>　　JUST BE YOURSELF。 不要试图取悦所有人，现在做不到，未来也做不到。</p>\n\n<p>　　人不可能面面俱到。每个人应该会有自己最在乎的人，他们才是你<a href=\"http://www.duwenzhang.com/huati/shengming/index1.html\">生命</a>中最宝贵的财富。倘若他们对你所做的事有误解或质疑，值得你花时间去回应和解释。</p>\n\n<p>　　以下是个人最在乎的三类群体，仅供参考：1、家人（亲戚不算在内，一年到头只见一回，并不清楚你的人生定位）；2、人生<a href=\"http://www.duwenzhang.com/huati/zhiji/index1.html\">知己</a>（为数不多的真正挚友，一切都知根知底）；3、牧师或导师（属灵上的导师，和职场中的前辈引领者）。</p>\n\n<p>　　他们的评价/意见/建议，则会认真的聆听。若存在不理解时，一定会充分的解释和回应。只有真正在乎的人相对全面了解你，其他人大部分是片面的认知。在生活中也没有特别的交集，有的只是道听途说或仅仅是几面之缘而已。</p>\n\n<p>　　不必回应那些熟悉的陌生人，他们并不一定真正关心你，更多的只是好奇宝宝。时间如此宝贵，无暇顾及这些，也不在解释的义务范畴。你的人生并不需要活在他人的言语中，还有很多更重要的事等着去做。</p>\n\n<p>　　内心强大的人，很少在意他人的看法，包括熟悉的陌生人。就像积极的人很少关注消极的信息，即便看到，也自动瞬间被屏蔽或消化。他们很清楚自己的定位和追求。</p>\n\n<p>　　遇到了障碍，会想尽一切办法铲除。遇到了<a href=\"http://www.duwenzhang.com/huati/cuozhe/index1.html\">挫折</a>，也不轻易<a href=\"http://www.duwenzhang.com/huati/fangqi/index1.html\">放弃</a>倒下。克服了困难，便<a href=\"http://www.duwenzhang.com/huati/yongyou/index1.html\">拥有</a>了力量。解决了问题，便拥有了智慧。走出了黑暗，便拥有了希望。对他们而言，这些仅仅是人生的必经之路。</p>\n\n<p>　　真正内心强大的人，一定有一颗平静的内心，有一颗温柔的心肠，有一颗智慧的头脑。一定经历过狂风暴雨，体验过高山低谷，也见识过人生百态。惟愿我们在人生的道路上，不论何种境遇都能充满智慧的刚强壮胆，成为内心强大的人。</p>\n', '', '1', '20180816195739');
INSERT INTO `xujm_cms_article` VALUES ('30', '18', 'zh', '如何成为一个内心强大的人？', '如何成为一个内心强大的人？', '如何成为一个内心强大的人？', '<p>弱者普遍易怒如虎，而且容易暴怒。强者通常平静如水，并且相对平和。一个<a href=\"http://www.duwenzhang.com/huati/neixin/index1.html\">内心</a>不强大的人，自然内心不够平静。内心不平静的人，处处是风浪。再小的事，都会被无限放大。一个内心不强大的人，心中永远缺乏安全感。</p>\n\n<p><img alt=\"\" src=\"http://p.triplegain.chidaotv.com/cms/2018/08/16/153442061843512og.jpg\" style=\"height:250px; width:524px\" /></p>\n\n<p>　　不够强大，意味着很容易受到外界的影响，通常表现为：要么特别在意别人的看法，要么活在他人的眼目口舌之中。从而<a href=\"http://www.duwenzhang.com/huati/shiqu/index1.html\">失去</a>独立的判断能力，变得摇摆不定和坐立不安。</p>\n\n<p>　　要想成为一个内心强大的人，需要具备至少以下六大品质特征：1）高度自律和自黑；2）必须经历<a href=\"http://www.duwenzhang.com/huati/juewang/index1.html\">绝望</a>；3）培养独处的能力；4）不设限的思考；5）需要一个信仰；6）BE YOURSELF（做自己）。</p>\n\n<p>　　1。 高度自律和自黑</p>\n\n<p>　　为什么不说<a href=\"http://www.duwenzhang.com/huati/zixin/index1.html\">自信</a>呢？不自信的人，普遍内心比较<a href=\"http://www.duwenzhang.com/huati/cuiruo/index1.html\">脆弱</a>。一个自信的人，对自己充满信心，做事往往带着积极向上的力量，并时刻充满激情。所有的盲目自信，和空腹自信，都是自以为是。心中要有真才实学，哪怕在不断的试错，但终究能到达攀登高峰的那一天。</p>\n\n<p>　　人的自信到底从何而来？以及如何培养自己的自信？高度的自信，从高度的自律而来。自律又是什么？自律就是自己管理自己，自己约束自己。这是一个很重要的能力。先学会克制自己，用严格的日程表来控制<a href=\"http://www.duwenzhang.com/wenzhang/shenghuosuibi/\">生活</a>，才能在这种自律中不断磨练出自信。自信也代表着对事情的控制能力，连最基本的<a href=\"http://www.duwenzhang.com/huati/shijian/index1.html\">时间</a>都控制不了，谈何自信？</p>\n\n<p>　　除了自律以外，自黑的能力也相当重要。世界之大，什么鸟都有。等你哪一天稍微做出点成绩，很多认识或不认识的人便在背后，唧唧歪歪的议论是非。从最开始的吐槽，到断章取义的论断甚至无趣的黑你。</p>\n\n<p>　　自黑就是自己嘲笑自己，自己黑色幽默自己。自黑是一种沟通方式，也是一种境界，更是一种另类的<a href=\"http://www.duwenzhang.com/wenzhang/renshengzheli/20080818/15697.html\">修养</a>。自黑不是等到有人说你时才出现，而是从头到尾都需要有的能力。你必须看透那些<a href=\"http://www.duwenzhang.com/huati/wuliao/index1.html\">无聊</a>恶俗的人，要比他们还会擅长黑自己，待他们自知无趣后，便会羞愧的退场而去。</p>\n\n<p>　　2。 必须经历绝望</p>\n\n<p>　　经历绝望的意思，就是已经走过这段岁月。也许你还未曾绝望过，并不意味着你不<a href=\"http://www.duwenzhang.com/huati/jianqiang/index1.html\">坚强</a>，但一定没有经历过绝望的人坚强。未绝望过的<a href=\"http://www.duwenzhang.com/wenzhang/renshengzheli/\">人生</a>是不<a href=\"http://www.duwenzhang.com/huati/wanmei/index1.html\">完美</a>的人生。绝望可能是<a href=\"http://www.duwenzhang.com/\">情感</a>、<a href=\"http://www.duwenzhang.com/huati/shiye/index1.html\">事业</a>抑或无法面对的<a href=\"http://www.duwenzhang.com/huati/gudu/index1.html\">孤独</a>等等。</p>\n\n<p>　　「必须」 是一个前缀词，一个重要的状态。「必须」并非主动选择，而是做好充分的心理准备。当绝望来临时，坦然无惧的接受它，即使当下极其<a href=\"http://www.duwenzhang.com/huati/tongku/index1.html\">痛苦</a>，甚至失去了自我。在绝望中寻找<a href=\"http://www.duwenzhang.com/huati/xiwang/index1.html\">希望</a>，才是值得体验的一种人生。</p>\n\n<p>　　强大的人不是征服什么，而是能承受什么。一些事情，只有经历过了，才能明白其中的道理，和懂得人生的真谛。绝望并不可怕，可怕的是失去<a href=\"http://www.duwenzhang.com/huati/yongqi/index1.html\">勇气</a>和激情。经历绝望，但不要被绝望吞噬。相反你要胜过它，如同战胜黑暗，迎接光明一样。</p>\n\n<p>　　3。 培养独处的能力</p>\n\n<p>　　孤独和独处并不是一件事，是两码事，而且经常会被混淆。人们往往把交往看作一种能力，却忽略了独处也是一种能力，并且在一定意义上是比交往更为重要的一种能力。如果说不擅交际是一种<a href=\"http://www.duwenzhang.com/huati/xingge/index1.html\">性格</a>的弱点，那么，不耐孤独就简直是一种<a href=\"http://www.duwenzhang.com/huati/linghun/index1.html\">灵魂</a>的缺陷了。</p>\n\n<p>　　要耐得住<a href=\"http://www.duwenzhang.com/huati/jimo/index1.html\">寂寞</a>，不随波逐流。<a href=\"http://www.duwenzhang.com/huati/gudan/index1.html\">孤单</a>是一个人的狂欢，狂欢是一群人的孤单。所谓的<a href=\"http://www.duwenzhang.com/huati/chengshu/index1.html\">成熟</a>，就是你越长大，越能学会一个人适应一切。在独处的时光中，找到自己真正热爱的，并培养自己独立的判断能力。</p>\n\n<p>　　人只有先学会爱自己，才有能力爱他人。如果你不学着与自己对话，便更难和别人交流。越能独处的人，越能面对和理解困境，也越能与他人相处。因为能瞬间换位思考，更能设身处地为对方着想。</p>\n\n<p>　　4。 不设限的思考</p>\n\n<p>　　你的眼光要比别人远，你的心胸要比他人宽广。天天算计的人生，未来迟早也会被人生算计。除此以外，还活在各种小心眼和小格局之中。</p>\n\n<p>　　人生如同开车一样，当你比别人快30码，你体会到的感受别人无法感知。人生又如同开飞机，当你比别人高30000英尺，你看到的视野自然不同于他人。意思就是，当你在<a href=\"http://www.duwenzhang.com/huati/zhuiqiu/index1.html\">追求</a>更高更远的美景时，也就不必在意他人短视的眼目。一切自然云淡风轻，不再受影响。</p>\n\n<p>　　宽阔之后，就不会受狭隘主义的捆绑。<a href=\"http://www.duwenzhang.com/huati/ziyou/index1.html\">自由</a>之后，就不会受形式主义的限制。</p>\n\n<p>　　5。 需要一个信仰</p>\n\n<p>　　人实在太有限，不论你信仰什么，总归要有一个信仰，否则和动物无任何区别。</p>\n\n<p>　　在这个时代，几乎人人都有信仰，只是各自的信仰不同而已。有人信仰权力，有人信仰<a href=\"http://www.duwenzhang.com/huati/jinqian/index1.html\">金钱</a>，有人信仰自我，有人信仰<a href=\"http://www.duwenzhang.com/wenzhang/aiqingwenzhang/\">爱情</a>，有人信仰<a href=\"http://www.duwenzhang.com/huati/xingfu/index1.html\">幸福</a>，有人信仰美食，有人信仰党派，有人信仰制度，有人信仰无神，有人信仰有神，有人信仰多神，有人笃信基督&hellip;&hellip;</p>\n\n<p>　　不管什么样的信仰，都令人值得尊重，而且任何信仰都需要深入了解并<a href=\"http://www.duwenzhang.com/huati/xiangxin/index1.html\">相信</a>，才能称之为信仰。任何一种信仰，如果是稀里糊涂的信，都称不上信仰，属于迷信，包括基督教在内的所有宗教信仰。</p>\n\n<p>　　智慧和真理，有着天与地的距离。学会渴慕真理胜过追求智慧。真理能使人更有智慧的来看待世间万物，<a href=\"http://www.duwenzhang.com/huati/kuanrong/index1.html\">宽容</a>的<a href=\"http://www.duwenzhang.com/huati/taidu/index1.html\">态度</a>面对错综复杂的人际关系，无比坚定的<a href=\"http://www.duwenzhang.com/huati/xinnian/index1.html\">信念</a>奔走人生之路，从容淡定的直面<a href=\"http://www.duwenzhang.com/huati/renxing/index1.html\">人性</a>的黑暗和世间的悲剧。</p>\n\n<p>　　6。 BE YOURSELF（做自己）</p>\n\n<p>　　JUST BE YOURSELF。 不要试图取悦所有人，现在做不到，未来也做不到。</p>\n\n<p>　　人不可能面面俱到。每个人应该会有自己最在乎的人，他们才是你<a href=\"http://www.duwenzhang.com/huati/shengming/index1.html\">生命</a>中最宝贵的财富。倘若他们对你所做的事有误解或质疑，值得你花时间去回应和解释。</p>\n\n<p>　　以下是个人最在乎的三类群体，仅供参考：1、家人（亲戚不算在内，一年到头只见一回，并不清楚你的人生定位）；2、人生<a href=\"http://www.duwenzhang.com/huati/zhiji/index1.html\">知己</a>（为数不多的真正挚友，一切都知根知底）；3、牧师或导师（属灵上的导师，和职场中的前辈引领者）。</p>\n\n<p>　　他们的评价/意见/建议，则会认真的聆听。若存在不理解时，一定会充分的解释和回应。只有真正在乎的人相对全面了解你，其他人大部分是片面的认知。在生活中也没有特别的交集，有的只是道听途说或仅仅是几面之缘而已。</p>\n\n<p>　　不必回应那些熟悉的陌生人，他们并不一定真正关心你，更多的只是好奇宝宝。时间如此宝贵，无暇顾及这些，也不在解释的义务范畴。你的人生并不需要活在他人的言语中，还有很多更重要的事等着去做。</p>\n\n<p>　　内心强大的人，很少在意他人的看法，包括熟悉的陌生人。就像积极的人很少关注消极的信息，即便看到，也自动瞬间被屏蔽或消化。他们很清楚自己的定位和追求。</p>\n\n<p>　　遇到了障碍，会想尽一切办法铲除。遇到了<a href=\"http://www.duwenzhang.com/huati/cuozhe/index1.html\">挫折</a>，也不轻易<a href=\"http://www.duwenzhang.com/huati/fangqi/index1.html\">放弃</a>倒下。克服了困难，便<a href=\"http://www.duwenzhang.com/huati/yongyou/index1.html\">拥有</a>了力量。解决了问题，便拥有了智慧。走出了黑暗，便拥有了希望。对他们而言，这些仅仅是人生的必经之路。</p>\n\n<p>　　真正内心强大的人，一定有一颗平静的内心，有一颗温柔的心肠，有一颗智慧的头脑。一定经历过狂风暴雨，体验过高山低谷，也见识过人生百态。惟愿我们在人生的道路上，不论何种境遇都能充满智慧的刚强壮胆，成为内心强大的人。</p>\n', '', '1', '20180816200716');
