  `nickname` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '昵称',
  `sex` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '性别(2女1男0未知)',
  `city` varchar(100) CHARACTER SET utf8 DEFAULT '' COMMENT '城市',
  `avatar` varchar(150) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '头像url',
  `birthday` int(11) NOT NULL DEFAULT '0' COMMENT '生日日期',
  `signature` varchar(255) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '个性签名',
  `cid` varchar(200) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '个推cid',
  `level` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '等级',
  `experience` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '经验',
  `lng` double(20,12) NOT NULL DEFAULT '0.000000000000' COMMENT '经度',
  `lat` double(20,12) NOT NULL DEFAULT '0.000000000000' COMMENT '纬度',
  `role` smallint(6) NOT NULL DEFAULT '0' COMMENT '用户授予角色:0普通 1投资顾问',
  `is_recommend` tinyint(1) NOT NULL DEFAULT '0' COMMENT '1推荐',
  `inside_role` smallint(6) unsigned NOT NULL DEFAULT '0' COMMENT '内部账户角色,0：普通账户、1：机器人，2：内部账户, 3: 测试账户',
  `invite_code` varchar(8) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '邀请码',
  `parent_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '上一级userid',
  `user_state` tinyint(2) unsigned NOT NULL DEFAULT '1' COMMENT '用户状态(0离线1在线2在忙3在聊)',
  `fans_num` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '粉丝数',
  `follow_num` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '关注数',
  `lang_code` varchar(10) CHARACTER SET utf8 NOT NULL DEFAULT 'zh_CN' COMMENT '用户语言',
  `sorts` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `add_time` bigint(16) unsigned NOT NULL DEFAULT '0' COMMENT '注册时间',
  PRIMARY KEY (`user_id`),
  KEY `user_id` (`user_id`),
  KEY `cid` (`cid`(191))
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='用户信息表';

